"rating":"4.0",
"reviewcomment":"Went on a Tuesday evening at 7:00 pm and got seated within 10 minutes. We sat on a picnic table on the patio which apparently, is considered &#34;outside&#34; of their physical limits to serve alcohol, so I was denied a cold refreshing Singha beer. Regardless, I ordered one of their signature dishes, the Khao Soi with tofu ($14; also available with beef or chicken, and shrimp for an additional cost), and it was the most heavenly thing I&#39;ve ever had. The egg noodles that floated above the coconut milk curry sauce were crispy and crunchy.<br><br>Service was adequate, nothing to complain about. If I were to return, I&#39;d definitely try sitting at the bar. I think it&#39;d a different experience being inside and sitting at a long communal table than on a big picnic table outside. It was also windy so dust from the road was sure to get onto our food....",
