"rating":"4.0",
"reviewcomment":"Where does one begin...The staff alone make the experience of eating at the Stockyard worth the price of admission (not very much I might add) <br><br>BUT THE PORTIONS are ridiculously huge a &#39;Dinner&#39; meal (under 16.00 with tax) is enough to feed 2 ample eating persons, and for those with normal appetites 4 people can easily eat out of the box (yes they put your food in a box for consumption). If only every eatery provided such satisfaction.<br><br>The decor is wonderful with a maritime feel, the only thing i&#39;m surprised they don&#39;t have is a trough!<br><br>I would routinely go out of my way to go and eat at this wonderful place...put it on your list of places to dine this summer, you will NOT be disappointed.",
