"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/4D2uQLYURzG09YnKCl5WUA/l.jpg",
"rating":"3.5",
"reviewcomment":"First time at Kinton Ramen -- I decided to go here with my friend because it&#39;s authentic ramen compared to other ramen places I&#39;ve been too. So far, the reputation of Kinton is in the mark - authentic Japanese ramen from broth to noodles to toppings. <br><br>I ordered a cold ramen dish, which is a new addition to their menu and it did not disappoint! Absolutely amazing in flavour and the portion was just right. I was a bit disappointed that there was only one piece of chicken but it is so filling that I&#39;m glad I didn&#39;t have to eat any more food than I can handle. <br><br>The atmosphere is great, but a bit too loud with the music. It is also a bit claustrophobic  because it&#39;s a small ramen shop, but aside from that it&#39;s a very nice, friendly place. A definite go to place with a couple of friends for a bite to eat! If you don&#39;t mind the yelling and loud music, I definitely recommend going to Kinton for authentic ramen, it&#39;s an experience worth having.",
