"rating":"3.5",
"reviewcomment":"Fantastic! Delicate and subtly flavored, but hearty and delicious. We seemed to be served by whoever was nearest rather than one person - I definitely loved the cooperative family atmosphere. There was a light, fragrant aroma to the dumplings, almost Jasmine or lavender like, barely perceptible but that absolutely made my meal. Service is sweet, portions are good, presentation great (adorable dessert dumplings!), food is fresh and delicious, and I LOVED watching the cute ladies make dumplings and wave at the babies brought by to watch.<br><br>I&#39;ll go against popular opinion here and say the chive pancake, while good, wasn&#39;t my favorite. But I loved the steamed bakchoi and mushroom. <br>This is a place I&#39;m happy to recommend and revisit and give my money to! I foresee many a dumpling craving in my near future.",
