"rating":"4.0",
"reviewcomment":"Went here for my traditional BBQ bday dinner last night. I guess it should be bbbq because of my bday, amirite? Sorry. <br><br>The measure of great BBQ, for me, is the brisket. Is it tender? Is it juicy? Does it have a decent amount of &#34;pull&#34;? Will it love me for who I am? Yes, yes, yes, and god I hope so. <br><br>Had the sampler for 2 with beef ribs, chicken and of course the aforementioned brisket. It was all well seasoned and had a good amount of smoke infused. No surprises, ain&#39;t nothing wrong with that my man. The sides were also decent. For $65ish for the 2 of us that&#39;s not bad at all. And also, can I say, being offered still and carbonated water? Yes. <br><br>Go here for some honest BBQ.",
