"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/Lki6oLofPUwp2cDJkOcGtA/l.jpg",
"rating":"3.5",
"reviewcomment":"A 5 star establishment for many reasons: a music venue drenched in nostalgia from my university days, best late night nachos in the world, and friendly staff that hustle into the late hours. <br><br>The vibe: Busy, large, dive bar vibes with big booths, and a music venue upstairs where the floor actually moves when there&#39;s enough people dancing. Late night snacks, pitchers and cheap breakfast. <br><br>The food: Sure, it might not be gourmet, but Sneaky Dee&#39;s food has satisfied me many of late nights. The veggie king&#39;s crown nachos are my absolutely favourite. So much guacamole, so much cheese, so much good. These people know their nachos. Even their poutine with their shredded cheese (blasphemy, I know) is delicious in my mind. Their breakfast is pretty good too. It&#39;s pub food, but whatever.<br><br>My go to meal: Veggie King&#39;s Crown<br><br>Secret: You can customize the nachos. Some of my friends are hooked on plain nachos with guacamole baked into the cheese. It&#39;s divine.",
