"rating":"3.5",
"reviewcomment":"I had a team lunch here yesterday; first time I ever had Terroni&#39;s and it won&#39;t be the last.<br><br>As this is the 200th review, I can&#39;t add much new.<br><br>Yes, it is noisy and yes, it is in a really cool space.<br><br>I had a pasta dish involving long, flat noodles, sausage, mushrooms and olive oil.  It was certainly some of the best pasta I&#39;ve had in a long time.<br><br>The bite sized sample of pizza I was able to talk myself into was equally delicious.  <br><br>I found portion size to be fine but if you are more interested in price or portion, there are better choices for the North American take on Italian.  This place is more about atmosphere and quality.<br><br>Service, in my opinion, was excellent.  <br><br>Recommended!  I see this place working really well on for a 2nd-3rd-4th date, the kind where you are going to a nice dinner on a Friday or Saturday night but still getting to know one another.  It could also work as a lunch date place.  Given the amount of pizzas on the menu, it would be fun to decide on two pies and share them.  The noise level, for me, means this place would not work for a super special date night (anniversary)--but hey, that is just me.  There are lots of office workers in this area so it totally works as a lunch/dinner place with your office pals too.",
