"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/MgV1d6PDnSr3m8Ea0qwRWg/l.jpg",
"rating":"3.5",
"reviewcomment":"C&#39;est what is the safest choice in the esplanade area. The venue is large enough to accommodate patrons without the need for a lineup which is a big advantage over the likes of biermarkt and Pravda across the street. <br>Additionally, cest what boasts one of the most impressive beer lists in the city and pairs some pretty decent food with it too.<br>The sweet potato chips that are often mentioned on yelp really are some of the best in the city. <br><br>The pool tables are available on a running hour basis. The bar also has the advantage of offering different niches, from a cozy couch area to one with pool tables and another facing a stage. <br>C&#39;est what also serves as a rotating exhibit for local artists (including yelp&#39;s own Neil T) and this is definitely something to appreciate in a local bar.<br><br>Overall consistent service, a cozy atmosphere matched with a fantastic beer list make C&#39;est What? one of the best spots you can rely on downtown.",
