"rating":"3.5",
"reviewcomment":"I visited Joey&#39;s on a Saturday night (around 8pm), there was a bit of a line up for tables so good thing we reserved a table ahead of time. This location is right off the subway line, attached to the Eaton Centre but you have to enter from outside. <br><br>The menu has many options to chose from, it was hard to pick just one thing. There are Indian, Japanese and American options. <br><br>We had the Chicken Souvlaki Sandwich, Steak and Mushroom Demi and for dessert Molten Lava Chocolate Souffle. The Chicken Souvlaki was great, good portion and the chicken had flavour and tender. The steak was a smaller than expected size but the mashed potatoes that came with it was good. The Souffle was amazing! It was just the right amount of chocolate and sweet. <br><br>There are business-casual elements with a full bar and TVs showing games but I also like that there is potential for an intimate setting without TVs pointing at you every direction. <br><br>I would come back to Joey&#39;s to try more of there menu and for the Souffle!",
