"rating":"4.0",
"reviewcomment":"Since the last time I was here, it feels like the menu has changed. While there is an overwhelming selection of burritos, they also have satisfying salads and soups. I ordered the soup of the day, which was a red curried lentil (?) and a small Greek salad. The soup was delicious!  I loved lentil soup!<br><br>Funny story, I sat there for 30 min waiting for my salad to come out. No one asked me how I was doing or if I wanted anything else. I called a server and told her I was waiting for my salad. She gave me a perplexed look; came back and told me none had been sent to the kitchen!  Considering my first server threw the business card on the table when I asked for the wi fi password, I was not surprised my order was overlooked. Thankfully, the 2nd server was more gracious and quickly sent the order to the kitchen.<br><br>The salad was on the house. Because they rectified their mistake, I am rating them highly.",
