"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/gUzMBHwM1c5jPRnSTYRFkw/l.jpg",
"rating":"4.0",
"reviewcomment":"FatCat watch many documentaries...  One documentary showing how life is in India..  Sooo many people everywhere... No white lines on roads.. no traffic lights anywhere.. people trying to sell you something on every corner...  cows walking around streets like its no body business..   Total Chaos for FatCat...  FatCat always wonder how country actually still functioning... <br><br>Well..  Now FatCat get a small taste of it  right here in Canada at Bajara restaurant, where entropy is in overdrive...<br><br>Things FatCat like<br> - Foooood.  Friend asking what they should try when they go.. FatCat say it doesn&#39;t matter, because everything is very good.<br> - Have parking lot - but not try to park here if you have SUV or other big car.. Don&#39;t ask why.. Just trust FatCat.. Park on street.<br><br>Things FatCat not like<br> - Total chaos..  Order get messed up by servers.. Place totally rammed like yonge/bloor subway platform at 8:30am on Monday morning.. FatCat trapped behind table and cant go wee..  No one know what the heck going on with food...  But FatCat realize that everything work out in the end somehow and everyone walk out or restaurant alive and smiling..<br><br> FatCat now understand how busy countries like India still function well, even with all  chaos.  FatCat learn new way to operate in life... FatCat call this &#34;go with the flow&#34;.  No more illusion of control over affairs FatCat not able to control.  <br><br>Then FatCat and crew walk down the street to XO Karaoke (FatCat also do review of XO)",
