"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/GL79l7rTVtbl6_Jl8NyNqw/l.jpg",
"rating":"4.5",
"reviewcomment":"This place is a place of legend. We exited at Rosedale station looking to go to Canadian tire. We needed material for our business. <br><br>As soon as we walked out of the station however our priorities shifted completely. The smell. The smell brought us in. We had no idea where it was coming from so we wandered. Men on a quest. <br><br>When we were about to give up, we thought &#34;maybe it&#39;s coming from the convenience store?&#34; &#34;No way. Are you stupid?&#34; And bam. There it was. A shop with no name. Just this camel. <br><br>We looked in but we were unsure. Giving it a shot we opened the door. The smell! The smell. There were other items on the menu that day, but we saw nothing but the pulled pork. That was what called us there. <br><br>As I bit into my sandwich I almost cried. The soft soft bun. The sweet sauce. The slow cooked meat. The best pulled pork sandwich I have ever eaten. <br><br>We gave our thanks and walked away, but we both looked back to make sure it didn&#39;t magically disappear. One thing was certain that day: we had shared an experience and will never be the same again",
