"rating":"3.5",
"reviewcomment":"Insomnia Restaurant &amp; Lounge located in the heart of Annex is a cafe by day, and trendy restaurant by night.  It consistently delivers great food, music, friendly service and has a wide variety of martini and cocktails, making it the perfect spot for, well, just about any occasion! The restaurant has a relaxing and inviting ambiance with dim lighting and upbeat background music.<br><br>Live DJs are also featured nightly at 10pm, which provides some pleasant, although not overpowering, entertainment. There is a fair amount of seating considering similar venues in the are and some lounge seating in the back of the restaurant which is really cozy.<br><br>The menu is a mixture of Mediterranean, French and International flavours. The wide variety of over 50 martinis is perfect for Martini Madness, which happens every Thursday night ($5 Martinis and $6.50 Premium Martinis). Not a martini type of person? The restaurant also offers $4 Steam Whistle pints! And If you can&#39;t make it on Thursdays, Insomnia offers daily events and specials catering to everyone&#39;s needs each night of the week. On Fridays, they have $3 Jameson Shots and $3 Candy Apple Shots, and the $11 pizzas are always a hit on Sundays.<br><br>We&#39;ve been to Insomnia more than a few times, and their tasty Rosedale pizza-pesto, portabello, sundried tomatoes, red onion, chevre &amp; olive oil-is amazing, but Thursdays are by far the best day to go.<br><br>The  late night snack menu also makes for a perfect romantic date, or a catch-up with the girls. One of our favourite items on the late night snack menu is the Calamari Po&#39; Boy sandwich: two small sandwiches with crispy calamari, fresh lettuce and spicy aioli, super yummy for only $5!<br><br>Insomnia is open late 7 days a week from 10am to 2am, making it the perfect spot for breakfast, lunch, dinner and post work entertainment in the Annex. If you haven&#39;t been yet you are missing out on one of Toronto&#39;s best!",
"reviewcount":"162",
"pricelevel":"$$",
