"rating":"4.0",
"reviewcomment":"Wow Sushi totally rocked my world.<br>I don&#39;t know what my boyfriend and I were doing around here (I think looking for a theatre). I don&#39;t know why we were around here, but when we saw Wow Sushi, we decided to check it out since our friend Bernie goes here.<br>We absolutely loved it.<br>The place is small. We were lucky to get seated right away on a Saturday night.  There aren&#39;t many tables here. Maybe like 5-7 and a party was taking up two of them.<br>No sooner had we sat down when diners started appearing at the door.<br>I had spicy salmon that was so good it made me sad I didn&#39;t live in the area. I would get take out from this place any day of the week.<br>We also shared the Philadelphia roll (cream cheese, avocado, salmon). It was heavenly.<br>My boyfriend loved his meal as well.<br>I did feel a little rushed when we were here... more from the people waiting at the door, staring down my food than from the servers (although we felt a little pressure from them too).<br>The sushi however, was so good that I would definitely want to return.",
