"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/wHFr_we_GimZHUrpHfqDXA/l.jpg",
"rating":"3.5",
"reviewcomment":"* * * * 7 West is a game-changer! <br><br>This place is 24-7-365!! seriously, it&#39;s always open. This place is a super cozy and intimate hot spot to go with a few friends for anytime (prefer: late night) cuisine or on a date (I&#39;ve brought more than a few first dates here). And surprisingly, not every person knows about this little gem! <br><br>Now, I want you to imagine yourself in the Yonge/Bloor area, it&#39;s 4 a.m., it&#39;s been an amazing night with you and your friends, but now you&#39;re all starving.. some people will settle for McDonald&#39;s, others want breakfasty-food.. 7 West is the answer. It offers an exceptional menu with dozens of meals--burgers/sandwiches to salads/soups to entrees and breakfast foods. They serve great coffee, and if the time is right, even alcoholic coffee beverages. <br><br>Definitely a good choice at any time, but personally, I like going late nights when the candles lit up the wooden interior of the room and the small rooms make for great fun. <br><br>Menu: <a href='/redir?url=http%3A%2F%2Fwww.7westcafe.com%2F7westmenu.pdf&amp;s=416571d1a84a89bbcb7cf3f4db4f65274e8ad7331be7f67b2babcf65f98c04c7' target='_blank' rel='nofollow'>7westcafe.com/7westmenu.…</a><br>Recommendations: Penne Chicken, Penne Arrabiata, Mac N&#39; Cheese with bacon/ham, All-Time Breakfast, (Double Stack) Grill Cheese with bacon/ham, Pulled Pork Sandwich, Irish Whiskey Coffee, and ANY desert. <br><br>Keep it classy ladies and gentlemen, enjoy!<br><br>-Ace<br><br>&#34;There cannot be good living where there is not good drinking&#34;",
