"categorystrlist":"Belgian,         Gastropubs,         Beer, Wine & Spirits",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/densFidAujO-U8ZgStBOCw/l.jpg",
"rating":"3.0",
"reviewcomment":"Free entry, live bands, and double digit % alcohol beer, what more can you ask for?<br><br>As I start to age, I&#39;m detesting the clubbing scene and looking for somewhat happening but laid back place, I&#39;m finding myself more and more often at Bier Market.<br><br>Definitely get here before 1030pm if you want to avoid long lines. For some reason they start holding up the line even when the place isn&#39;t packed, also you get a lot of line hoppers or people holding a spot in line for like 20 people, it can get pretty frustrating.<br><br>For extra good times, order some 10%+ beers, Delirium and a German one which I can&#39;t spell nor pronounce (starts with a K).<br><br>I like how liberal this place is, some semi-quiet space at the front for people to stand and chat, the mosh pit dancing area for people who want to get down and an easy access washroom path so you&#39;re not wading through a crowd like most clubs.",
