"reviewcomment":"Great spot for brunch.  So happy that we came here as we were very satisfied with the food and service.  The servers were warm, friendly and prompt.  The food selection tends to be heavy but that is what brunches are for, right?  To laze away the afternoon.  So we had the pulled pork grilled cheese, which was rich and savoury and paired with some jam on the side.  This is truly dangerous to have as a meal because you will think this much richness is normal.  We also had the Mexican waffle, which had savoury waffles, topped with super umami bison chilli that taste so bold and decadent.  All of this with poached eggs and salsa, guacamole and sour cream on the side.  I was in meat heaven.  Yummy in my tummy.<br><br>So there it is.  A happy place for brunch and I did not have to wait in line.  What a great spot and so accessible from my hood.<br><br>I will definitely be back here again.  I will have to make sure that I have earned it before I come here though and get those extra workouts to earn the great meals here.",
