"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/oFX703NiVA3kGYdTTfGuBQ/l.jpg",
"rating":"3.5",
"reviewcomment":"We had a wonderful dinner at Origin.  We were seated at the &#34;dining bar&#34; which we normally wouldn&#39;t choose but actually it was comfortable and surprisingly romantic.  <br><br>Starting with cocktails (try the &#34;First Flight&#34;) and the great decor, we enjoyed everything about this place.  The service (our server was also the manager) was outstanding, attentive, and knowledgeable, both about the food and the wine list.  We enjoyed all the dishes, but the highlights were the steak tartare and the duck tacos.  Also the Spanish fries were very good (but could have used a bit more chorizo).  The mozzarella menu is something unique and interesting.  We tried the one with the preserved lemon and the mix of flavours and textures was delicious. We ended the evening with a delicious vermouth on the house, which was a great surprise.  Definitely we&#39;ll go back.",
