"rating":"3.0",
"reviewcomment":"Brought my fiance here today for his birthday and im glad I did! Turned out it was $1 sushi Thursdays. Since were both sushi lovers we seized the opportunity and got a few nigiris and sushi rolls. SO GOOD! Probably the best I&#39;ve had. The main reason is because of their chili mayo sauce...to die for! Also, the size of the sushi rolls. They wern&#39;t ridiculously big and I could actually (somewhat elegantly might i add) fit one whole piece in my mouth. <br><br>The atmosphere is dark, romantic. Definitely somewhere to bring a SO or even for a fun night out with your girlfriends. They have a nice patio as well for when its nice out. The decor is beautifull. Havent been anywhere this nice in Toronto! <br><br>Service was good, could be better. I felt they needed more waiters. Ours was friendly and knowledgeable about the menu but I had to wait at times to get a refill of water and to get the check. It wasnt crowded plus I had reservations so we didnt wait at all.<br><br>Price wise...well $1 sushi im not complaining! Definitely good sushi and good price. Their main dishes (judging by the menu) were between 17-25 which is alao very reasonable.<br><br>Will I be back? YES! I want to try that red snapper dish....",
