"rating":"3.5",
"reviewcomment":"Finally! West-coast chic comes to Toronto! Love it!! And it was hopping busy, even though it&#39;s Monday evening.<br><br>I&#39;ve been to the Earl&#39;s chain of restaurants in a few different cities out west - in Alberta and BC. I never knew they had locations in Ontario! Soooo excited! But they&#39;ve been in Toronto for 3 years. What was I waiting for?! There&#39;s one in London Ontario, and they&#39;re hoping to expand into the USA. Go Earl&#39;s!<br><br>It&#39;s an upscale rib restaurant, with a huge seating area inside and out on the patio, with a clean and chic interior. There&#39;s an outdoor patio that was full already even though it&#39;s only May. This location is well situated to serve the financial district of Toronto. The food is gorgeous and so are the waitresses and waiter.<br><br>We ordered their special: a full rack of ribs for $25.00 so that we could take advantage of their $4 glasses of beer that go with it, and a burger with fries, at about $12.00. Both were delicious! <br><br>I would definitely go back. <br><br>Please bring Earl&#39;s to Ottawa!! Pretty please!!",
