"rating":"4.0",
"reviewcomment":"Went here on Saturday of may long weekend without a reservation and got a table within 10 mins.  The only thing is your waiting next to these plant pots with cigarette buds and garbage in them, which grossed me out. <br><br>The staff was nice and attentive even though they were busy. <br><br>We got a seat inside cause it was still a little chilly outside. I went over the menu and couldn&#39;t see the French toast that everyone raved about including blogTO. I asked the waitress and she advised that hasn&#39;t been on the menu in like a year and its still all over the internet. So I&#39;m putting it out there... <br><br>THEY DO NOT SERVE THE STUFFED FRENCH TOAST ANYMORE!!! <br><br>I was disappointed but was hungry so had go pick something else.<br><br>Order their $5 Cesar!! Almost everyone had one when we looked around, so you certainly can&#39;t go wrong. It was delicious. It wasn&#39;t watered down, thick and spicy! <br> I choose the mushroom eggs Benny without onions and Dave got lola&#39;s breakfast with frites.<br><br>We both thoroughly enjoyed our meals. My dish was loaded with mushrooms, you can take the herbs and lemon in the sauce and the home fries were nice and crispy. Mine was delicious. Dave enjoyed his too but it was eggs and bacons and frites and he loved the frites.<br><br>What started off disappointing left me satisfied and besides there&#39;s so many dessert places around that I was able to satisfy my sweet tooth after. <br><br>My only suggestion is adding a sweet dish to the brunch menu.",
