"rating":"4.0",
"reviewcomment":"Maybe it isn&#39;t hip to like a franchise restaurant, but I&#39;ve been to the Keg Mansion several times (15+) and I must say that I&#39;m always satisfied.  I like the atmosphere - usually busy but still feels intimate enough to carry on a conversation.  The servers are knowledgeable and friendly for the most part - sometimes a little rehearsed sounding but at least they cover all the bases.<br><br>Food always arrives hot and fresh and at the right time - not too fast and not too slow.  Mushrooms Neptune is always a good starter and they provide fresh baked bread right after you order.  <br><br>I think the steaks are great - I usually get a NY strip done medium and I would say that it is nearly always perfectly done.  My wife&#39;s order arrived too rare one time and we asked for it to be corrected.  They did so promptly, and refreshed the sides with the new plate.  They apologized and provided a complimentary dessert for the inconvenience.  That&#39;s what I call exceeding expectations!<br><br>Last night we went to the Keg and it came up in conversation that it was my birthday.  They brought dessert to the table on the house - sans the cheesy song and dance you get at some places.<br><br>I&#39;ll be back. Many times I&#39;m sure.",
