"categorystrlist":"Italian,         Tapas/Small Plates",
"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/d_Tdg4-lbBf-yoZ29ALsLA/l.jpg",
"rating":"4.0",
"reviewcomment":"I came here for a friends birthday. We reserved a private room and the birthday celebrant ordered an array of dishes from the menu. Food was AMAZING.<br><br>Served fresh and timely, you can tell the food was homemade and with quality. The meatballs, calamari, vegetables, fresh pasta and lamb were all to die for. <br><br>Our hostess was polite and very attentive to our needs. Unlike some places, they do separate bills. It may seem like a hassle and to some, a little unorthodox, but they to accept separate bills. Wine menu is pleasant, and the drinks are typical of any restaurant. <br><br>Atmosphere is dim and relaxing, however, some of the paintings on the wall were a little disturbing for my liking. The music they played was dope, but a little weird for the overall restaurant setting. There was an abundance of Biggie Smalls and Tupac, but did not expect it from a restaurant such as this. Overall a pleasant experience.",
