"rating":"3.5",
"reviewcomment":"I was with here with a friend &amp; bumped into another friend on the same visit. We shared a Turtle Cheesecake &amp; the friend we met later had a basket of onion rings bigger than my head. As enticingly crispy as they looked, I did not feel like any more food as I had just indulged in a Beef Empanada at Jumbo Empanadas prior to hitting this place up for coffee, desserts &amp; more chatter. <br><br>Impressive array of cakes &amp; cheesecakes... &amp; flavour-infused gourmet coffees. English Toffee was pretty good. Everyone gets French Vanilla &amp; I already know how universally appealing &amp; good it is, so I passed. <br><br>The place was overrun by Asian Visa students because there was a promotion for 20% off all-day breakfasts with student I.D. It&#39;s very close to U of T &amp; is a quaint, spacious atmosphere to relax &amp; study in so I guess the congestion was inevitable. <br><br>Very efficiently operated: I noticed that the entrees counter was separated from the desserts &amp; beverages one. If I actually had to eat a full meal here from start to finish, I would likely have to endure both line ups. That would not be fun. I especially liked its proximity to Spadina Station. The exterior Ultramarine or royal blue walls with medium yellow trim/accents make this place easy to track/describe to a friend. I could totally see myself meeting up with people here often in the future.",
