"rating":"3.5",
"reviewcomment":"This is, without exaggeration, the best food I&#39;ve had since coming to Toronto. Maybe it&#39;s because I&#39;m a sucker for fake chicken or maybe it&#39;s just really that good, but I&#39;m definitely returning.<br><br>I went here with my meat-loving boyfriend, whose food I sampled for the purposes of this review. We shared an appetizer of vegan buffalo wings. For me, this was the highlight of the meal. I looooved buffalo wings when I ate meat, and I had high expectations for these. I am pleased to say they were crunchy and the sauce was great.<br><br>I got the unchicken + waffles, and my boyfriend got the &#34;bacon cheeseburger&#34; with fries supremacy. Mine was great, and the sides of collared greens and sweet potato mash complemented it sooo nicely. I tried some of my boyfriend&#39;s meal too! The burger was nice, and the fries were awesome. Even my boyfriend, who is nearly a carnivore, really enjoyed it.<br><br>Overall, I definitely recommend eating here, especially if you&#39;re a vegetarian! Even if you&#39;re not, I still recommend checking it out.",
