"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/RZMdpOldutpAa-pO1N7olA/l.jpg",
"rating":"3.5",
"reviewcomment":"I visited this place for a friend&#39;s birthday. I was immediately impressed by how beautiful it was. The decor was well thought out, artistic and classy at the same time. <br><br>Service: We had about 20-25 people and the reservation/ seating all happened without a hitch. With a large group like that, I was impressed how organized they were with the seating. We were assigned one server with few other staff helping him.  He was very friendly and highly professional, not to mentioned organized.<br><br>Food: The food was delicious. I had the Spicy Italian Sausage Penne and did not regret it one bit. It was very good, the meat tasted fresh and the sauce was also well done. Their Sangria was also amazing. (P.S., the free bread and butter they give is glorious!). <br><br>I will definitely visit this place again. Only problem is that it&#39;s a bit pricey but it was expected.",
