"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/qCHgOA96QjYojQf_-0o8kA/l.jpg",
"rating":"3.0",
"reviewcomment":"Apparently, I passed by this place a million times and the big sign says &#34;3 brewers&#34;. I know some French, but I never knew this was what it was referred to and was the same place as Les 3 Brasseurs.  <br><br>Ambiance/Feel: Really cool and neat.  It felt really chill without feeling too dive-y and not douche-y either (it&#39;s Friday, my English is broken).  I was also impressed by the newspaper menu&#39;s.  It was unique (yes I&#39;m impressed by little things).  Just the overall vibe seems awesome and I hear it&#39;s 3 floors though I only saw 1. They also brew their own beer .  <br><br>So 4/5.<br><br>Service: Ahh...I hate judging service. I arrived earlier than my friends, being the not-so-fashionably early type and the waiter came around 3-4 times within 10 minutes to see if I wanted something to drink besides my water.  When one of my friends arrived about 10 minutes later, he didn&#39;t come around for about 5 minutes, strangely enough.  But they are busy and the guy was very  nice, so I have to give 3/5.  <br><br>Food/Beverage:  I ordered a shrimp and baby salmon pizza that had onions and veggies on top.  While I liked it, I think calling it a pizza is a bit of a misrepresentation.  It should be called &#34;seafood bruschetta&#34; or something like that.  That&#39;s what it tasted like.  Don&#39;t get me wrong, but I thought a pizza would at least have some melted cheese on it.  I know, it wasn&#39;t listed as one of the ingredients, but sometimes I go dumb and just make assumptions, but still.  For taste and creativity of the food: 4/5.  However, as my friend so &#34;delicately&#34; pointed out to the waiter, the pizza was barely sliced. I could literally pick it up by the corner and pick up the entire pizza with no risk of it coming apart. As for the beverage, ordered a Blonde beer and it went down fairly smooth, sort of like a Heineken or something.  So overall, I would give it 4/5 for food/beverage, but loses 1/2 star for pizza not being cut.  3.5/5<br><br>Final judgement: Cool place to hang out while at the Eaton Centre or Yonge/Dundas square and awesome location. 3.5/5.  Since I&#39;m in a good mood, I&#39;ll round up.",
