"reviewcomment":"Finally, we&#39;re here to experience the top Pho in Toronto! Cash only which could be a problem for some. Prices are very similar to other Pho areas except some stuff like their fruit shake at a remarkable price of $5!!! They got some nice combination of meat with rice or vermicelli noodles.<br><br>My friend got their beef noodle soup (famous here).<br>My bro got their vermicelli with some meats.<br>My other friend got the duck bamboo vermicelli.<br>My gf got the vermicelli with spring roll and meat.<br>I got the minced shrimp with crab vermicelli soup.<br><br>Beef Noodle Soup: Soup broth is definitely clear and non MSG, however, the beef is not very tender but tough based on my friends wording.<br><br>My Bro didn&#39;t think too much of his dish.<br><br>My other friend with the duck enjoyed it, but didn&#39;t really finish it.<br><br>My gf enjoyed her dish, but she usually enjoy eating in general.<br><br>My minced shrimp with crab soup vermicelli was good, however, like most other places it taste about the same.<br><br>Overall Conclusion: This place is rated very well in the Ossington Strip; however, I feel that it is good, BUT not the best Pho in Toronto.",
