"rating":"3.0",
"reviewcomment":"Czehoski, the name that just can&#39;t roll off your tongue, had for the longest time had me curious about what&#39;s inside the place with the weathered peeling original red sign (they really need to do a better job at preserving that sign). Yes, it took a Groupon to joust me here (which they handled quite well), but eh, I&#39;m finally here now at this recognizable Queen West upscale hangout.<br><br>It&#39;s dark in the back where we sat. But the music isn&#39;t loud and the crowd not anywhere as stuck-up yuppie as I thought. Heck, our friendly server was full of humour and delight, upselling wine (how do you run out of all the beer and wine I want early in dinner service?) and remembering I still don&#39;t have a clue what the soup of the night was. A good time was had by all.<br><br>The aforementioned tomato soup was great and swimming in delectable spices. I also dabbled in their perogies and pan-seared tuna, and it was alrighty. Despite the adopted name and theme, there isn&#39;t a lot of anything Polish or eastern European on the menu. But there are a lot of Queen West themed burgers. <br><br>There is an ATM in the basement. And though Czehoski isn&#39;t an ideal place to take kids to eat, except maybe in the brunch hours, I did see a server put away a high chair. Just sayin&#39;.<br><br>{TTC: the 501er to Palmerston/Tecumseth. Now look up. }",
