"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/oTYuYqJF17OCBKqPu8Blrw/l.jpg",
"rating":"3.5",
"reviewcomment":"Little place that&#39;s really convenient. Me and my friend were really craving a burger and got them to go. I got the original burger while my friend got one of their fancier ones (the name, I do not remember). Their prices are kinda high so I expected a large burger that would take me two days to finish.<br>I ordered the combo with fries and a can of coke while my friend decided on a combo with onion rings. Like I said before, this place is small so we had to sit at one of the dine-in tables to wait. Note: the tables are super close together so don&#39;t come here and expect an intimate dining experience.<br>Well, we waited around 20 minutes for them to be done and all this time, it was getting really stuffy in there because the kitchen is steps away from the register and dine-in area. At this point, I was getting quite frustrated because I had paid more than I had intended to with the burger and was waiting for longer than I had intended to. <br>Finally, we get our paper bags and happily carry them to eat elsewhere. The burger itself was pretty good but smaller than I anticipated it would be. The bun held up great. The fries were really yummy and my friend actually ate more of my fries than her onion rings. <br>I&#39;ll probably be back, and in a city where a lone burger costs around $10 in so many establishments, Big Smoke Burger is kinda worth it I guess.",
