"rating":"4.0",
"reviewcomment":"3.5*, bumped up due to HUGE portions for bbb + pbs (just under $8, ex. taxes).  <br><br>As I discovered, the problem with a large pork bone soup = Pork Bone Soup Fatigue.  You start off by diving into the morsels of fall off the bone meat, combine it with just the right amount of rice, but nearing the end of the pot, you sorta get tired of it.  :(  So if you&#39;re gonna order this dish here, make sure you come with an equally HUGE appetite!<br><br>Remember, there are also the side dishes (refillable) to contend with.  There were 7 of them for 2ppl!<br><br>Other Likes:  huge teapot of barley tea!  No need to flag the waitress down for a refill.  Pan fried beef dumplings were also yummy.  The bibimbap was apparently very good.  There were lotsa toppings and not finished in 1 sitting.<br><br>In terms of the Pork Bone Soup, it seemed less complex in flavour than others that I&#39;ve had.  Broth wasn&#39;t as glowing red, but this isn&#39;t a good/bad thing, just an observation.  What I did like was that about the soup was that it wasn&#39;t a sodium overkill!<br><br>Service was very efficient, no fuss.  Food rolled out quickly.<br><br>Random question:  When there are signs in Asian restaurants that say, &#34;Please do not flush toilet paper down the toilet&#34;, do you adhere to the signs??  :P",
