"reviewcomment":"My hotel recommended this place as I could walk to it. Boy, did they get it right. This place was fantastic! I started with the Charcuterie, a combo of curried meats that had been done completely in house. The summer sausage of veal was truly heavenly.  I would not have ordered the mushroom and brussels sprout salad if it wasn&#39;t for my friendly and attentive bartender/server. I&#39;m so happy she talked me into it, it was outstanding. <br><br>I had the special, beef duo based on in house processed beef. Well done chef, you are certainly worthy of your accolades. Then I had the dessert feature that was cornucopia of refreshing flavors that sent me to food heaven. <br><br>Love this place, I will be back for sure!",
