"rating":"4.0",
"reviewcomment":"So you are walking around St Lawrence market, and its going to happen.... you are going to be absolutely starving from sensory overload of food. It&#39;s everywhere all around you and you can&#39;t possibably decide what to eat so what do you do. What I did was looked to where there was a HERD of humanity all gathered around this sea food place.... asked the server what was most popular there (Pickrel and Chips), order up and dig in. <br><br>It was ovbiously very fresh as you could find vendors selling the darn fish fresh about 10 meters away, awesome tartar sauce (if your into that kind of thing) and nice crispy well seasoned french fries which i liberally dosed with malt vinegar.<br><br>Is it just me or does any place that tends to use newspaper as the wrapping around a fish and chips, almost 95% of the time, awesome? Well.... they do it good here, and how can you fail when you have so much product around you.... for reals.... EAT AT THIS PLACE!",
