"rating":"3.5",
"reviewcomment":"Service is good. Food is great! Venue is a very great diner like.<br>We walk in the door and the place looks awesome. It was smaller than I expected, but had a great diner vibe.<br><br>We sit down in this long bench next to other people, but the bench was big enough that it never feels like we were sitting next to them, we were just &#34;next&#34; to them.<br><br>The waitress, she explained all the dishes like they were her personal favorites which is awesome. And everything just sounded so tasty.<br><br>I had the Duck Confit Hash that has a salad with like fruit and nuts in it. And one egg on top cooked medium well. The duck leg was big  and the hash also cooked in the duck fat. Delicious!<br><br>So why the minus one star, no credit card? Really?<br><br>Anyways, I&#39;d come here again in a heart beat to eat more. Perhaps for dinner!<br>Keep it up Anthony Rose!",
