"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/DvCR063i6lFdqU-5KHoHMA/l.jpg",
"rating":"4.0",
"reviewcomment":"I always have to stop at Mother India when I&#39;m driving through Toronto.<br><br>The food here is by far the best Indian food I&#39;ve had anywhere. They specialize in rotis, and when they say roti, they mean whichever Indian dish you like, but inside a roti. Kind of like a wrap. I always get the mutter paneer roti, and my non-veg friends get the butter chicken roti, which is also amazing.<br><br>Be careful about the level of spiciness. If you normally ask for things spicy, I&#39;d recommend going for medium-level here. They aren&#39;t kidding around at Mother India. I&#39;ve gone with some Indian friends who asked for Indian-level spicy and their mouths got burnt off.<br><br> I almost always get take out, but I&#39;ve eaten in a few times too. It&#39;s definitely nothing fancy inside, but if you&#39;re coming for the decor, this isn&#39;t the place for you.",
