"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/LiewikdFWJctOPsrm_5wbA/l.jpg",
"rating":"3.0",
"reviewcomment":"I&#39;ve been here twice, both times when the weather was above 20 degrees and the sun shining.  The second time was Saturday evening.  <br><br>I ordered the same thing I ordered last time (mushroom flat bread and an order of sweet potato fries).  I asked for the fries to be extra crispy (they were) and the flatbread was great on it&#39;s own.<br><br>But what this place really has is the location --- and that&#39;s what this place is all about.  You&#39;re looking over the water with your meal and in Toronto, these are moments to enjoy! So, you can say if it wasn&#39;t for the location it might not be as good etc.. but they do have that location and it makes everything that much better.<br><br>Service: We had a new server who just started a week ago. She was friendly and tried to make things work.<br><br>I&#39;ll be back!",
