"reviewcomment":"Really busy place before a game but the staff were prompt, friendly and worked together to get orders out. Burgers were good. We did have a very simple order but our waitress. Who by the way Kelly D was just awesome. She checked on us so many times and was always serving with a smile. <br>And &#39;nuff said to be in the Hall of the Great One.  Took me years to forgive you Wayne in ruining the Leafs in Game 6 back in &#39;93 (high stick on Gilmore with no call) and went in to score the winner to force Game 7.  But after Gold at the Olympics all was good. And I love the memorabilia in the place. Just AWESOME.",
