"categorystrlist":"Ethiopian",
"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/V9SvUfx5MCMc9vwQzEU4Hg/l.jpg",
"rating":"3.5",
"reviewcomment":"This is a pretty standard Ethiopian place, no better or worse, in terms of food, service or decor than you&#39;ll find at any of the Ethiopian places in Toronto. It is a step up from Nazareth I&#39;d say in terms of food, but just as good as Lalibela (which is my usual go to). If you find yourself near Bloor and Yonge, this place is pretty good, but I&#39;m not making a special trip for this place. <br><br>The vegetarian dinner platter is quite a decent size and two people may have trouble finishing it (we didn&#39;t finish it). But I also discovered that Ethiopian left overs are pretty dammed good!<br><br>I do recommend that people have the coffee (no matter which Ethiopian place you are at). It&#39;s just a lovely way to end the meal, and always great coffee. Especially at this place. <br><br>I&#39;ve been here a few times and always thought it was just a small downstairs space but I just discovered yesterday they have a whole upstairs seating area, that&#39;s also where the washrooms are. <br><br>In the summer they have a small cute patio out front.",
