"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/B39Qv1EvMKKnhBqUrhzXMg/l.jpg",
"rating":"4.0",
"reviewcomment":"After wanting to try Union for some time now, I treated and took a friend here for a late brunch today.  We arrived just after 1 pm and were seated right away.   Wow...why did I wait so long to finally try Union... <br><br>We started off our meal by sharing the Steak Tartare which was served with butter pickles, two mustards, habanero and four servings of toast.  Although just enough to share between two people, next time I may just order this as an app all for myself.  Some people noted it was bland; I ate every bite of the tartare with a tiny hint of the condiments it was served with, and with a bite of toast.  Tasty flavour combinations which all worked well together, even surprisingly with a pickle; definitely got our palates wanting more.  <br><br>We both ordered the BBQ Rib Benny: smoked pulled ribs, poached eggs, hollandaise, greens and rosti. This was now my favourite eggs benny plate...the one to beat...my friend agreed.  Loved every bite of this plate.<br><br>I will definitely come back and also try dinner; sounds like I must try the elk sliders and ribs next.  Thank you for the great service and amazing food today, Union.",
