"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/h35TM9LYvadFdxFX9Bq44g/l.jpg",
"rating":"3.5",
"reviewcomment":"Went here with a group of 5 girlfriends and we had a great meal. We ordered one of almost everything on the menu and shared it all. Everything was AMAZING although I had a particular affinity toward the pork belly. The texture was spectacular and flavor... Well... I actually licked my plate, but just a little, we sat right in the window afterall. Hahha. <br><br>They should really review their staffing though, we were there on a Sunday of a long weekend, all of Ossington was bananas but these guys only staffed one server. Joe was totally slammed and couldn&#39;t keep up as everyone arrived in a big wave and we were all on the same schedule and the place was nearly full. We waited for 45 minutes with empty plates and wine glasses, and then another 15 after requesting our bill. There was also a long wait to order but the food came fast (meaning the kitchen was probably adequately staffed for the rush but not the front of house). Joe was great, super friendly and kept his cool the whole time but really needed some support. Poor guy was making drinks for everyone too! He was really really great, just a bad situation.<br><br>Ossington on the first long weekend of the year and only one FOH staff? Are you kidding me?! Lucky he was such a strong server or we probably would have walked out. That guy deserves a raise.",
