"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/f6A5jBWQVVdxT7joj3eDXw/l.jpg",
"rating":"3.0",
"reviewcomment":"#MILESTONES #YELP #FOOD #COCKTAILS<br><br>I really enjoy this particular Milestones location. It&#39;s right around my favorite area, close to the alma mater Ryerson, Dundas Square and Eaton Centre. And it&#39;s MILES better than the Jack Astors in the building. But, it&#39;s always fairly busy. <br><br>We were a group of 6. Service was a little bit of a bust, slower than usual on a Tuesday night. However, our server had a sense of humor and you could tell she was a people person. Had us charmed, and hence this is not the 3 star review it could&#39;ve been. <br><br>I ordered the following: <br><br>2 Margaritas - the first one was better than the second somehow. I am guessing a bartendar swap. <br><br>Bellini - WORST ever. Way too sweet. <br><br>Rare Prime Rib Steak - Perfectly prepared with the right amount of fat marbling. The sides weren&#39;t as good. Too much potato... and no greens in the veggie side. And a mustard dressing that didn&#39;t taste too good.<br><br>So, I had a reasonably good time. I enjoy Milestones, particularly because they have some great daily specials. I&#39;ll be back. <br><br>PS: the light fixture next to ours was leaking. And the table freaked out. Oh well, atleast it wasn&#39;t ours!",
