"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/P5NhtDwV23jOOKdHhW-Ssg/l.jpg",
"rating":"3.5",
"reviewcomment":"One of the best burgers I&#39;ve had at a bar in Toronto. Allen&#39;s and Dora Keogh&#39;s next door are both owned by the same family and both pubs are winners in my book. <br><br>You&#39;ll probably want reservations to eat in the dining room here, which is dressed up similar to cookie cutter NYC Irish pubs - blue checkered tablecloth, bar in the front, patio in the back. There are also a few seats out front next to Danforth Music Hall. Casual and busy on the weekends. <br><br>We sat at the bar and enjoyed wonderful pints of Guiness, but also split an amazing burger with Irish/Canadian bacon, melted cheese and Carmelized onions. It was really, really good. Don&#39;t hesitate if you&#39;re on the fence. The chips were large and fried nicely. I doused mine in vinegar and salt. The rest of the menu is kind of upscale - filets, lamb, seafood...but it all looked lovely and judging by the crowds, tastes pretty good too. I like this neighborhood on the east side of the city. Urban but not business-like. Check out Allen&#39;s if you&#39;re out this way and enjoy Guinness and burgers.",
