"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/ZyNZRHKs80lFmf8ntT7vgA/l.jpg",
"rating":"4.0",
"reviewcomment":"Agreeing with many of the other yelpers - this joint is definitely one of the best restaurants in Koreatown. I am a regular customer and never have I once had a bad dish or time there. Whether it is their tofu stew, bulgogi, short ribs or bibambap - it&#39;s always so delicious! <br><br>I really like their fried pork dumplings for an appetizer. But I&#39;m sure any of the apps would still be great. One great thing about this restaurant is that you could tell the servers that you don&#39;t like a dish and the manager will make sure you get something better. Although I assure you that you most likely will enjoy everything if you get if you like authentic Korean food.<br><br>I love the service so much here that I will wait if there are no tables available. The business is owned by a lovely family and the son is really exceptional when it comes to pleasing customers. Although it&#39;s categorized as Korean, I feel like this place is also comfort food. Having a rough day? Go there, feast and have a cold Sapporo. Surely a great fix to any weekday worry.<br><br>Reasonably priced, delicious and always a good experience. Love this place!",
