"reviewcomment":"* this review is a bit dated*<br>I came here for Summerlicious 2013. This place is pretty chic and nicely decorated. For some reason, it reminded me of several fancy posh restaurants in Las Vegas - needless to say, the environment is very appealing to the eyes. My Jamaican friend was really digging the décor as well.<br>I guess it comes with the territory that this is an expensive location, Linda Modern&#39;s price tag is generally $1-5 above market rate for similar dish offered at other Asian restaurants. <br>Foodwise, my friend was not impressed at all and didn&#39;t finished her main course. Since I generally enjoy salty food, I had no problem finishing everything in my plate. However, even I found their food a bit too salty and had to wash it down with 3 cups of water. <br>Although we were there for lunch, we ordered their Asianized cocktails to go with our food. It&#39;s definitely a good decision. We loved the presentation - very cute and tropical.<br>Perhaps you should give it a try too - even if you are only there for their drinks =) No one will judge",
