"rating":"3.0",
"reviewcomment":"After a Jays game on a near-perfect night, this Jack Astor&#39;s is a fun place to be. I had not been here before, but will be back.<br><br>1. The food is good. I had a burger that was tasty, but could&#39;ve had more meat. All of the toppings were fresh.<br>2. The sides are pretty standard. I had a salad instead of fries, and it was surprisingly green and fresh, as well as better than I expected it to be.<br>3. There are plenty of TVs playing all major sporting events.<br>4. They have plenty of indoor and patio seating. At peak times you will wait! There is ample seating here for larger parties.<br>5. They have a sufficient selection of beers on draught.<br>6. The service here is a bit better than average, but might be less so on a terribly busy night.<br><br>A meal here before or after a Jays game will cost the same as a meal inside the park, yet with better food.",
