"rating":"3.5",
"reviewcomment":"My colleague suggested we try this Thai restaurant for lunch today.  I am glad it is located just within walking distance from our office.  The restaurant is not big but very nice decorated.  The space between tables is wide enough so I don&#39;t feel crowded at all.<br><br>The servers are very friendly.  I ordered the Wednesday $9 special...gaeng masaman (chicken curry w/peanuts, tamarind sauce, onions and deep fried shallots with rice).  My colleague ordered a pad Thai.  The portion of the curry special looked tiny but actually it was just enough for me. The pad Thai was not bad but my colleague said that the pad Thai in Canada is always a bit salty.<br><br>We got very delicious complimentary spring rolls as a compensation for a 30 mins wait for our lunch.  Well, this thing happens.  The kitchen possibly screwed up our orders.  The server came to apologize and handled the incident very friendly.  The food there definitely worth the wait but hopefully not 30    something minutes again as promised by the server lol.<br><br>I will go back for lunch or dinner when I am craving for Thai food again for sure:)",
