"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/ifqpTyINSe_vjzCRrWdQ9g/l.jpg",
"rating":"4.5",
"reviewcomment":"You will get schnitz-faced. Guaranteed.<br><br>Schnitzel Queen on Queen East at first glance is a rather unassuming hole-in-the-wall place in a rather hole-in-the-wall part of eastern downtown. But walk in and you&#39;ll feel like you just stepped in to the kitchen of someone&#39;s home. It&#39;s very small, with enough kitchen bar seating for 3-4 folks crammed in.<br><br>Karl the owner will gladly provide you with his finest schnitzel sandwiches, all under $10. And for $10, holy crapo these things are indeed huge! The slattering of savoury sauerkraut and other tasty stuff in a small bun... there is no way you can keep it all together before you even open your mouth and say ahh. Even half of a schnitzel is practically a full deli sandwich or a pretentious gourmet burger. Better make room in your tummy, lest you get schnitz-faced.<br><br>Too bad they only open until 7pm. And only on weekdays. Cash only. <br><br>{TTC: any Queen streetcar or the 75 to Queen/Sherbourne.}",
