"rating":"4.0",
"reviewcomment":"it was from the Food Network show You Gotta Eat here that my bf, his bro and i ended up here on a whim one day in the summer. they only take cash, but they have an ATM near the bathrooms in case you don&#39;t have any with you when you go. <br><br>suffice to say you do wait quite a while for the food, but IT&#39;S WORTH THE WAIT!! everything is made fresh to order (often made with ingredients bought right inside Kensington Market), accompanied by some chips and 2 cornichons (those are mini pickles). my personal favourite is the Grilled Motzy, with the sundried tomato pesto, mozzarella, and arugula lightly dressed with balsamic reduction. most who know me are aware i&#39;m not a super huge fan of the acidity in balsamic, but the reduction was light, a bit tart and just flat out DELISH! <br><br>once you&#39;ve been here, you will NEVER look at a grilled cheese the same way again..and seriously: YOU GOTTA EAT HERE!! <br><br>the prices do seem a tad outrageous, but personally, i&#39;ll pay a bit extra for food made with fresh ingredients that are often bought within the Kensington neighbourhood.",
