"rating":"4.0",
"reviewcomment":"Best vegetarian restaurant ever!  Our party had some apps which included king oyster mushrooms, soy drumsticks on a sugar cane, dumplings, and shrimp tempura and cold spring roll.  The &#34;shrimp&#34; tempura was delicious and you couldn&#39;t even tell it wasn&#39;t really shrimp.  I also loved the soy drumsticks as they came on a nice sugar cane like Vietnamese pho places.  As for the other apps, I won&#39;t go into much more detail as I loved all of them with the exception of the cold spring roll.  It was quite bland.  However, executing that many apps so well is tough, so I can&#39;t expect everything to be perfect.  <br><br>As for my main, I had the Spicy &#39;Seafood&#39; Coconut Currylot Soup-er bowl.  OMFG!  I think I am having wet dreams about it.  Jk.  It had noodles, mock shrimp, mock squid, mock salmon and other veggies in a delicious spicy coconut broth.  The best way to describe it is a Tom Khai soup but with all veggies and 10x better.  <br><br>Verdict: def. going back for a Soup-er bowl.",
