"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/OIsxOKnjBxJ1loJY3ACXFQ/l.jpg",
"rating":"4.0",
"reviewcomment":"Boar for brunch? Hells yes. Thank you Beast for changing my opinion on what type of meat is classified as suitable for brunch!<br><br>A gnocchi poutine topped with real curds and boar was the perfect appetizer, as were the dirty rice balls. Not sure what made them so dirty, but I guess I am no expert on dirty balls. :) Both were hefty portions and the two dishes were enough for me, along with my Labatt 50 and pickleback. Who knew pickle juice would calm the burn of whiskey?<br><br>I also tried the Beastwich and it was definitely beasty. Giant, open-face fried chicken on a biscuit, smothered in a sausage gravy and fried egg. Well worth the eating if you are hungry! <br><br>I would recommend coming early as a few of the brunch items were sold out by the time 1:30 rolled around. Certainly a sign that really good things just don&#39;t last :)",
