"reviewcomment":"Excellent meal!<br>Wife and I both had fish and chips (she had Halibut &amp; Onion Rings, I had Seabass &amp; Fries).  Both were prepared very well - perfect batter, light, flaky, not extra greasy!  The onion rings were also superb, possibly the best I&#39;ve ever had.  The fries were good too (NOTHING wrong with them), but they couldn&#39;t compete with the onion rings.   I&#39;m guessing anything they deep fry turns out awesome. <br>Also, I strongly recommend the garlic based sauce (instead of standard tartar sauce).  It was addictively tasty.  <br>Very impressive selection/options on their menu.  To be clear, their menu basically has fish sandwiches, poutine, fish &amp; chips, and a few other things, but the sheer volume of choices in customizing these options (type of fish, type of fries, type of sauce, etc).  Makes me want to keep coming back to try all the variations.<br>Also a very impressive list of Gluten free menu options (and beer options!), if you&#39;re into that sort of thing.<br>Prices were very reasonable, most expensive dish I saw was $14.",
