"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/Io8TM0K97oaWGKkbiW6Ynw/l.jpg",
"rating":"3.0",
"reviewcomment":"So many mixed reviews here. <br><br>I came in with three friends on a cold winters day for poutine week #lapoutineweek. After spending a year in rural Quebec and only eating poutine in greasy spoons, I&#39;m a purist. I almost never stray away fries, gravy (&#34;sauce&#34; in Quebec) and squeaky cheese (cheese curds). In this circumstance our server, Matt highly recommended the Mighty Loutine, pulled pork poutine. I went for it.<br><br>Two of us had the small pulled pork poutines, one a small chili-cheese poutine (for veggies) and other is lacto, so she went for a pulled pork sandwich and fries. First, fries were awesome. Fries are the base of any poutine. Cheese curds are fundamental to any poutine. Anyone that throws in any random cheese to poutine, is not poutine. A real poutine means squeaky cheese. The gravy was good, but the primary takeaway from this meal was the yummy pulled pork, stringy, and season perfectly. Poutines were $7.90. so you can&#39;t really go wrong. For two bucks more you can go for a large poutine which is enormous. Hello, gluttony!<br><br>I&#39;m also going to mention the service, because it was remarkable. I can&#39;t remember the last time I&#39;ve had such a great customer service anywhere. Matt was super friendly, attentive, and must have brought over a dozen re-fills before we could even ask. I&#39;m definitely coming back here for afterwork drinks.",
