"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/izI3dTQjlVX0HHloaiwXgw/l.jpg",
"rating":"3.5",
"reviewcomment":"Always a big fan of the Keg! This location is great!<br><br>Had Raptors tickets and a bit of a gift card to use up, so made our way up to the York Street location. It was freezing cold outside walking up York, so we said we&#39;d take the PATH back to the ACC. (Which is SUPER convenient)  <br><br>We got there right at 4pm (actually got there at 3:45 and they were still locked so we hung out in an office building connected to it that had a really nice lobby) and were seated right away by the window. <br>Everything came out very quickly and was all cooked very well! Patti&#39;s prime rib cut was HUGE and i filled up on crab cakes, steak and shrimp. Shrimp brings melted butter that you can use on your potatoes ;)<br><br>No apple crumble though on the newer menus? Sadface.<br><br>Paid up and got back into the PATH system which we took all the way to the ACC! Screw being outside when it&#39;s cold!",
