"reviewcomment":"I know it&#39;s wrong to compete on sandwiches, especially when I haven&#39;t had Black Hoof yet, but this is currently my favorite sandwich in Toronto. Peameal bacon, topped off with banana peppers and all the sauces you want...I see you. Let&#39;s be friends.<br><br>The sandwich is pretty filling for its price, and although you might be tempted to get a breakfast sandwich (who doesn&#39;t love eggs, and the combination is actually probably tastier than straight up meat)...there is so much value added with the regular. I wish I had diversified and gotten croissants/egg tarts along with the peameal bacon sandwich...next time!",
