"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/mJr3AKtzXK-IDRJl3Qiehg/l.jpg",
"rating":"3.5",
"reviewcomment":"As a fan of live music and patios, I can&#39;t believe that I have not been to the Rivoli in the 15 years I&#39;ve lived in Toronto.<br><br>I&#39;m not sure what&#39;s kept me away... perhaps the fact that the patio is almost always full and you get the feeling that those who are there are guarding the seats with their life. Or maybe I have been here, and I just don&#39;t remember.<br><br>At any rate, today, a good friend of mine called me up and asked if I wanted to join her and her wonderful little daughter for lunch. It was the first patio Saturday of the year and I knew that I could get to the Rivoli early and snag a spot of this perfect-for-people-watching -patio.<br><br>The menu is a mishmash of cultures, which I&#39;m generally not a fan of, but for some reason, it seems to work here and I was surprised to see many things that I&#39;d like to try. I got a table right in the corner and ordered a Caesar. <br><br>GREAT Caesars here! Our amazing server asked me &#39;how do you like it?&#39;, which I thought was really nice, since I do happen to have a spice tolerance equal to that of a dragon. She returned promptly with a delicious looking drink, brimming with horseradish, sambal oelek, and crowned with three green olives and a spicy yellow pepper skewered on a cocktail sword. A GREAT Caesar!<br><br>My friend had the fish tacos, which she enjoyed and which her daughter deemed &#39;picy&#39;, which in year and a half year old language means &#39;spicy&#39;. I had the Pad Thai. Normally a no no for me to order ethnic food when not at the corresponding ethnic establishment of said food. But I was quite surprised! The noodles were well cooked and tossed in a &#39;picy but slightly sweet sauce that did not appear to include ketchup. It could have used a little more fish sauce and lime for me, but I&#39;ve had worse Pad Thai at actual Thai restaurants. The shrimp were fresh and plump and there were nice charred pieces of green onion topped with lots of crunchy peanuts and bean sprouts.<br><br>Our server was even so nice as to offer to bring some plain rice for my friend&#39;s daughter. We asked if we could have tortilla chips instead and she was happy to oblige. Luisa loved the chips and I&#39;m sure the dog on the other side of the patio was happy to have a kid dropping lots of food for them to mow down on later.<br><br>I would definitely come back to the Rivoli. The people watching is fantastic, and although this strip of queen street has become more touristy than trendy, that&#39;s completely ok with me. There&#39;s an open feeling here compared to west of Spadina where there is zero room on the street and at the Rivoli, it&#39;s actually really funny to watch the tourist families gape at people who have pink hair.<br><br>A solid establishment.",
