"rating":"4.0",
"reviewcomment":"My new favorite macaron place!<br><br>* White Chocolate Strawberry<br>* Caramel Sea Salt <br>* Passion Fruit Cream Cheese<br>* Earl Grey<br>* Lychee <br>* Macchiato<br><br>These macarons are to die for - they are so fresh and the fruit flavors are like eating actual fruits.  My top 2 are lychee and earl grey (taste like the tea!). I usually like the espresso flavors but the macchiato was way too strong.. doesn&#39;t have the delicate taste.<br><br>The actual store is not much to be in - it doesn&#39;t really have that cozy café feel unfortunately.  <br><br>The one thing I like about this place is that after 5pm there are still options to be had.  Some place I&#39;ve been to after 5 have 2 choices or NO macarons at all!  <br><br>Definitely worth the trip - top notch for your French delight craving!",
