"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/NVmx_TeKeXP9igcloYz1AA/l.jpg",
"rating":"4.0",
"reviewcomment":"This place is the FUBU of mexican takeout, except it&#39;s For Vegans By Vegans.  It&#39;s no secret that most Mexican can be made vegan friendly-- just omit cheese and sour cream from a vegetarian menu item.  The result is usually overpriced and unbalanced in flavour, but hey, at least you&#39;re eating, right?  That all goes out the window at Hot Beans, where every menu item is a well thought out star.<br><br>No veggie ground-round, no copious amounts of daiya cheese.  Instead, their menu boasts things like jackfruit, TVP, queso, and cashew crema.  Their flavours are novel and surprising.  You&#39;ll like it not just because it is veg-friendly but because their take on Mexican food is new, fresh, and most importantly, delicious.",
