"rating":"4.0",
"reviewcomment":"It was a quaint location in a quieter part of town .  I had dinner here in the middle of the week while in town on a business trip.   The ambiance was warm and the bar was a good size for the space.  While it was quite slow for mid week, there were several groups of people that were eating together.  <br><br>Extensive Italian Wine list but a smaller dinner menu. I ordered the Tuna.  And although was underwhelmed by the size, it was amazingly delicious!  Really a well flavored dish and I enjoyed the tuna/clams combo.   I had only wished I had seen the chalk board above the open kitchen area that listed the specials before ordering.  I probably would have ordered the Risotto special.   <br><br>They had a long family size table right in the middle of the space.  I would go back to taste more of their flavorable dishes even though knowing the portions might be on the smaller side.",
