"categorystrlist":"Greek,         Mediterranean",
"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/tKgtRl7h7TWD_RTSUt-4LA/l.jpg",
"rating":"3.0",
"reviewcomment":"Opa!  The saganaki is always great; we usually start with this.  I have personally enjoyed the &#34;small&#34; beef souvlaki and pork souvlaki dinners.<br>Why &#34;small&#34;?  Because the regular sized dinners are far more than I could ever consume in one sitting.<br>Pricing is good.  The &#34;dinner&#34; includes a really good Greek salad, piled high on the plate with generous olives and cheese.  The potatoes are flavourful but not greasy, and the meat is always cooked to perfection.<br>We have also visited the location in Newmarket, but there is something to be said for the Danforth.  <br>This place is always busy.  If you come after 6 p.m. you will likely have to wait in line.<br>A must visit restaurant on the Danforth!",
