"reviewcomment":"I had a great dinner at Daisho last week when I visited Toronto. Sat outside on the terrace. I found service to be both friendly and attentive. <br><br>I wanted to try so many different things on the menu since they all sounded so great, and none of the NYC Momofuku restaurants have these dishes on their menus. <br><br>I had: <br><br>Pakora bun<br>Fluke with avocado, black rice and blood orange<br>Snap pea salad with horseradish, jowl bacon and lily bulbs<br>Grilled striped bass with coconut curry, pickled clam and puri<br>Asparagus with crab, English muffin and egg<br>Grapefruit sorbet, macadamia nut and meringue. <br><br>Everything was well prepared and delicious. Wish I had added another day to my trip because I would have loved to have returned to Daisho to try the other half of the menu.",
