"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/YFORp2p0-7iQPlnxw8TBYA/l.jpg",
"rating":"3.0",
"reviewcomment":"Located in the heart of the entertainment district, Fred&#39;s Not Here is a small restaurant whose food will continue to keep it a favourite of mine.<br><br>One word: paella. The seafood dish is amazing. They bring you the pan that it was cooked in, and it practically took up my side of the two person table. With a hefty lobster placed right in the middle, just a waft of the dish made me swoon with delight. Rich, savoury and plenty for leftovers, this dish is a must try. <br><br>The place is dim-lit, and seems to veer people toward more intimate conversations. The service is around average, but the food I&#39;ve tried is great. <br><br>Worth a trip just for the paella.<br><br>More on my blog here - <a href='/redir?url=http%3A%2F%2Fsavourthethought.blogspot.ca%2F2013%2F01%2Ftake-in-take-out-freds-not-here-toronto.html&amp;s=defa7715d921ea364b6eb97445265888137d36997fadffcbe63efc8386cdb922' target='_blank' rel='nofollow'>savourthethought.blogspo…</a>",
