"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/66lGDeE3DMmsTiclXzuoUw/l.jpg",
"rating":"3.5",
"reviewcomment":"I came to Trattoria Mercatto one day for lunch with some relatives who were visiting Toronto from overseas. <br><br>The restaurant is a good and clean establishment that is decorated well and definitely a good option for a restaurant that is located in a mall when you want a sit down restaurant and don&#39;t feel like eating at a chain that is typical of shopping malls.<br><br>I ordered two appetizer dishes for my meal:<br>1) Misticanza - mixed lettuces, celery hearts, radish, aged sherry vinaigrette ($8) - this was a good salad and a decent sized portion for an appetizer<br>2) Frutti di Mare - marinated shrimp, scallops, calamari, red onion, crostini ($11.50) - this was like a ceviche (although with cooked seafood) or a seafood salad with a vinaigrette-type dressing served in a dish with two small and rather thin pieces of crostini on the side. If you order this dish, I would recommend that you get a salad too because you receive much more seafood than could possibly fit on the two pieces of crostini, so I ended up using the left over seafood as a topping on my salad.<br><br>Our server was attentive and our guests enjoyed themselves. Overall it was a good experience.",
