"rating":"3.5",
"reviewcomment":"I would recommend Duff&#39;s Famous Wings! <br><br>This Duff&#39;s location was very clean and service was excellent! We were eagerly greeted by a server, who checked on us frequently through out our visit. There was not one time that I had to look up more than once before being noticed. <br><br>We ordered a special combination, which was 20 wings, small pitcher of beer (3 glasses), and potato wedges which was $34.50. Comparatively it is cheaper than other highly rated wing places in Toronto (with booze). While there was not a huge variety of wing flavors, they seem to do what the offer right. We got the medium and bbq. Both were adequately sauced, with a convenient bucket to hold all the bones. <br><br>We would definitely go back. Plus, there is street parking for $2.25 per hour, which for the city is decent. Worth the trip. Also, the patio (currently closed because of snow, looks promising for the summer).",
