"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/ol-dJG5xppOReyfOkxgGaw/l.jpg",
"rating":"3.5",
"reviewcomment":"3.5 stars and rounded up. I was craving some ramen today and noticed that many of the other places with higher Yelp reviews don&#39;t offer vegetarian options and/or are farther from the subway.<br><br>I ended up ordering the vegetarian version of the Ji Su Men (A soy sauce base soup combined with eggs and sesame oil. Mixed with stir fried vegetables.) I found the portion size to be very large and the meal really quite satisfying. I wish I could of had some tofu in there, but my waitress said that unfortunately they could not add any to my dish. <br><br>I also ordered a hot green tea for $1 that was served way too hot and with the tea bag still in the cup. It was too hot to drink during the meal (or even to touch the cup), but I was able to enjoy it after I finished eating once the tea had cooled down to a more reasonable temperature.<br><br>The prices are also affordable and the service is friendly and efficient. Would recommend if you are already in the area and looking for some ramen.",
