"reviewcomment":"really really tasty. promptly seated just after 11 on a Saturday and food came out FAST. menu options are a plenty so I&#39;m glad I took a peek on yelp in advance and went with the HUEVOS DIVORCIADOS - a soft corn tortilla topped with two runny eggs, two salsas (red &amp; green), black beans, and served with a side of guacamole, ancho jam (YUM), three slices of baguette toast, and your choice of home fries or salad (for indecisive people like me, they offer 1/2 and 1/2 too). <br><br>the combination of flavours &amp; textures = winning! spicy, buttery, salty, sour, creamy, crunchy, sweet...luckily there was toast to mop up all dat sawce so I could polish the plate clean -- like a lady ;) <br><br>space is small but it&#39;s clear that they use it wisely to deliver prompt service, and we never felt like we were bumping elbows nor needed to talk over our neighbours. prices are a tad more expensive than you&#39;d find at a regular diner but I was satiated &#39;til evening so i&#39;m a happy camper. can&#39;t wait to go back!",
