"rating":"4.0",
"reviewcomment":"last night I tried the Chef&#39;s bento box $25.   They also had Uni on special so I ordered that and some Unagi sushi.  The Uni was melt in your mouth, velvety and custard like.  yum!  The Unagi was freshly grilled.  The Bento box had tempura, tuna tartar (like poke if you&#39;re been to Hawaii, otherwise you won&#39;t know what I am talking about), salmon belly and 5 pieces of sushi.  All fish (no fake crab or other cheap substitutes!).  <br><br>Salmon, tuna, Tai I think, then white tuna and the last one was scallop! OMG, it was so good.  it was on the board as a special but she said they didn&#39;t have enough to make orders...lucky me to get that!  <br><br>Hubby had their University Sushi set.  I definitely got the better deal I think though his was $18 I think. <br><br>Again rice is nicely done, not stuck together and over dressed and the fish were thickly sliced and the right temperature.  I&#39;ve had white tuna before but it&#39;s partly frozen still and we&#39;re waiting for it to defrost before we can eat it.  This was just the right temperature.  HEAVEN!",
