"reviewcomment":"I had a shockingly good meal here, in a lovely room with excellent service. All three courses were a home run, but I actually teared up a little when I finished my main course and then contemplated the strong possibility that I would never get to eat it again: a &#34;walnut foie&#34; that was so velvety and delicious and so perfectly complemented by amazing quinoa and charred escarole that I really fear the rest of my culinary existence may be a let-down. <br><br>Also delicious: the raw salmon with yummy leaves, the root vegetable tartare (who knew vegetables could do that?) and a dessert called &#34;textures of chocolate and caramel&#34;. It was all awesome, and not &#34;awesome for vegetarian food&#34; -- I happened to order veggie dishes but there&#39;s lots of meat and fish on the menu. The foie wasn&#39;t just a consolation prize for giving up foie gras (something I did a few years ago, in one of my few food vs ethics concessions) -- it was more mind-blowing than any goose foie I&#39;ve eaten.<br><br>If I lived  in Toronto, it would be hard for me to choose any other restaurant for future celebrations or special meals. But I don&#39;t live in Toronto anymore, so I guess I&#39;ll just have to give up eating altogether.<br><br>P.S. I did deduct one star from my rating for the menu&#39;s egregious misspellings of  both &#34;pomegranate&#34; and &#34;meringue&#34;. But I mentally gave it a six-star review, so it still works out to five.",
