"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/1oR9QwKwHx-NIJ2iOk-NXg/l.jpg",
"rating":"3.0",
"reviewcomment":"I used to eat here all the time, I believe this place and Ginger are owned by the same people. At one point early on after they opened they had Ginger&#39;s logo on their menu. Their food is very similar to what they have at Ginger, casual Vietnamese fare (Pho, noodles, rice dishes, Vietnamese sandwiches). It took them a little while to work out the kinks in their menu, if my memory serves correctly, I believe they originally had steak or burgers on their menu. Most of those items are gone, they do have some random items still on their menu like butter chicken, but overall its almost exactly like Ginger. I used to get their salad rolls, spring rolls, Vietnamese sandwiches, and combo meat noodle dishes which were all pretty good. My girlfriend used to get Pho from there alot as well, she said it wasn&#39;t the best but it was OK.  They also have cheap alcohol and smoothies there too, but it never seemed like a place where I would ask friends to go grab a drink.<br><br>Its pretty cheap, around $7-$10 for most of their main dishes, their sandwiches are cheaper (around $4) and so are their appetizers. I&#39;d say its just slightly pricier than Ginger, but a much nicer atmosphere and you get table service. <br><br>Side note: They did admit to putting MSG in their food once when we asked, but they said &#34;only a little bit&#34;. So that&#39;s something.",
