"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/aQY26xhr28pMIXyEqCXgxA/l.jpg",
"rating":"4.0",
"reviewcomment":"YUM YUM YUM YUM!!!<br><br>I am literally salivating remembering my last meal here. I&#39;ve eaten many happy and memorable meals here. For a vegetarian, there are limited options which they more than make up for in quality and outright deliciousness.<br><br>I could honestly eat the Kabilee Rice every single day and never get tired of it. It&#39;s one of the best things I&#39;ve ever tasted. EVER! Your plate is literally mounded with enough (cardamon spiced?) brown basmati rice to feed a village and topped with deliciously and delicately sauteed carrots and raisins. You don&#39;t need to be a vegetarian to enjoy this ridiculously delicious dish. Everyone who I&#39;ve (grudgingly!) let try it has absolutely loved it. The boulangee (a potato and herb stuffed pancake/bread) is also pure heaven.<br><br>I can&#39;t speak to the meat dishes but my friends tell me they&#39;re amazing. <br><br>The atmosphere is no nonsense. You order at the front and bring your food to your table, being careful not to trip because there&#39;s not alot of room. You&#39;ll want to get in and get out because there will be someone else waiting very eagerly for your table. Lunch time is super busy so get there early if you want a seat.<br><br>Highly recommended!",
