"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/1stXSfWt1SXqKhmVO5VZRw/l.jpg",
"rating":"3.0",
"reviewcomment":"A picture is worth a thousand words; so is one bite of a robust juicy steak.<br><br>When Wildfire Steakhouse &amp; Wine Bar opened it&#39;s doors at it&#39;s new downtown location, it did so with a cosmopolitan makeover, but with the same classic menu as its North York location that has established itself as one of Toronto&#39;s great steak houses. Modern tweaks appeal to vegetarians. We&#39;re hard pressed to think of another steak restaurant that caters to vegetarians and also proudly lists gluten-free options.<br><br>While the cocktail crowd nibbles on crunchy polenta cubes and succulent chipotle and lime-marinaded beef kabobs, our eyes are on the racks of lamb, tangy ribs and piri piri chicken whisked to neighbouring tables. But we&#39;ve come here for the steak. Aged in-house for forty days, this quality Canadian beef is as tender as it gets. Owner, Jody Ness, has his finger on the pulse with an urban-chic vibe, but knows that you can&#39;t fake a great steak. Melting in house-made butters like peppercorn, shallot truffle, and blue cheese, add a creamy essence to already mouthwatering morsels.<br><br>Serving an award winning selection of wines in an unpretentious ambience, right in the heart of Toronto&#39;s financial district, Ness delivers on his motto of hospitality, &#34;one guest at a time&#34;.",
