"rating":"3.0",
"reviewcomment":"I came here last week on a whim with some friends b/c the burger&#39;s priest was sold out. <br><br>The decor was pretty nice, but we chose to sit at the bar cause they were playing some football game and my friends are really into it.<br><br>I found the prices to be a bit steep considering they don&#39;t come with a side..but whatev&#39;s. I wanted to see what this place was about.<br><br>My friends ordered the veggie burger and the burger cellar burger, and I wasn&#39;t crazy hungry, so I just got the duck poutine.<br><br>OH LORD JESUS IT WAS FANTASTIC. <br><br>Fresh cut fries and chunks of duck, covered in curds and gravy...oh lord. It was good.<br><br>The only qualm I had was that it could&#39;ve used more gravy, and it got mad salty at the end.<br><br>My friends loved their food as well, and actually couldn&#39;t finish the veggie burger, so there&#39;s that.<br><br>I&#39;d come here again.<br><br>Sidenote: When I got my bill, there were a few items onthere that we didn&#39;t order..but she cleared that up right away.<br><br>Side side note: If you are there, post a photo of the place on instagram with the hashtag TheBurgerCellar for a free app!",
