"reviewcomment":"I&#39;m a fan for visiting the smaller gems in Toronto and this place did not disappoint in the food or the service.<br><br>I went during the Summerlicious promotion and the place was not as full as I would expect it to be during this season which I found a bit surprising. The server that was with us that day knew the menu very well and had very well-informed suggestions which is rare to find especially during Summerlicious.<br><br>I had the dinner menu for $35 which for me consisted of the following:<br><br>Albacore Tuna Crudo<br><br>Perth County Pork and Seasonal vegetables<br><br>Cherries Jubilee<br><br>All-in-all, great food and a great environment to be in. To read the full review and to see the pictures from the meal <a href='/redir?url=http%3A%2F%2Fpiqueyeater.wordpress.com%2F2013%2F07%2F19%2Flucien-toronto%2F&amp;s=641550d145a9ee2014518ced60ffecb67ca7c59048089a03db5750c0590b269c' target='_blank' rel='nofollow'>piqueyeater.wordpress.co…</a>",
