"rating":"4.0",
"reviewcomment":"Came here last night to catch the Raptors game. <br><br>$5 drink specials - I had fun. :) Asked the bartender to mix me something from bar rail and he brought me back a drink containing three of my favorite ingredients for an alcoholic beverage - cake vodka, amaretto and pineapple (pic with recipe included below). <br><br>Service was fast and friendly. They were attentive but not annoying. Wasn&#39;t super busy but I didn&#39;t mind. Oscar (owner) was super accommodating about seating us where we wanted. <br><br>Had a bunch of those drinks and also ordered some crepes. I got caramel apple (LOVED) and my date got the berry ones (I didn&#39;t like them but I&#39;m picky, he liked them). <br><br>Bartenders were great. At the end of the night, Oscar came over and got us a round of shots and sat and talked for a bit - love when owners take the time to do that. It&#39;s good to see they have a vested interest in making sure their clientele are happy. <br><br>This place is fairly new but they&#39;re already doing everything right (and I don&#39;t say that often, considering I have worked in the hospitality industry most of my adult life, am a business owner myself, and am generally critical). Go check them out. :)",
