"rating":"3.5",
"reviewcomment":"Blowfish can blow their own horn!  This was a welcome treat during our May 2014 visit to Toronto.  The spicy edamame was something I hadn&#39;t tried before and really liked.  The drinks were an excellent accompaniment to the meal.  The calamari and korean beef apps we had really set the stage for some terrific sushi rolls. I didn&#39;t care for the orange and black salmon roll, but I&#39;m not a fan of salmon to begin with so no surprise there, I just don&#39;t like fishy fishes, but wifey felt it was good.  The Ebi Shooter was simply awesome and the flavors seemed to change as you made your way from top to bottom, or bottom to top depending on your preference.  Even the non-sushi fans in the group enjoyed their meals here which gave them confidence to try things that they normally wouldn&#39;t - white people, go figure ;-)<br><br>All in all, I would recommend this to anyone looking for a moderately priced sushi, Asian restaurant and if I ever make it back to the great white north, I&#39;ll stop in again!",
