"rating":"3.5",
"reviewcomment":"I&#39;m a woman who has been disappointed by them many times. Sometimes I meet them at a party. Sometimes they catch my eye at a nice restaurant. Occasionally I even spot them at the supermarket and bring them back to my place (!). They sound good, they look good. The problem is that once I put them in my mouth, it&#39;s kind of a letdown...what, you&#39;ve never had a bad crabcake? Did I not say &#34;crabcake&#34;?<br><br>People, here&#39;s a tip: It&#39;s at e11even. It swims in mustard remoulade. It lasts 2 heavenly minutes and costs $21, which is too much.<br><br>Follow that up with Tuna Tartare ($19), chilled, flavourful and snuggled in spicy aioli; then Deviled Eggs ($7 for 4 halves), which will have you imagining Chef Graham Pelley as everyone&#39;s favourite person to invite to a Midwestern church potluck.<br><br>I was already stuffed at this point in my meal, but you know, [insert cliché here that might justify why I kept eating despite being almost uncomfortably full]. Washing it all down with my delicious and spicy Dark and Stormy ($12), I carried on.<br><br>The Speckled Trout with fingerling potatoes and green beans ($33) was tender and doused in truffle butter with enough to share, but the side greens were too meagre for my carb-stuffed liking. I also tried the Lobster Roll ($27) which was quite tasty, as was the side of stringy fries - I would have eaten more of it but by now I was so full, I didn&#39;t think I&#39;d make it to the Raptors game.<br><br>Highlight: the BREAD. Sweet, salty, soft, warm, buttery, everything. EVERYTHING.<br><br>Other highlight: the BIDETS. Well *that&#39;s* something you don&#39;t see at Sneaky Dee&#39;s. I didn&#39;t try them, seeing as I&#39;m not a raging sociopath, but I would love to meet the person who, mid-dinner date, goes to the bathroom and decides to go the extra mile of freshness while other people are waiting around outside. Or maybe I wouldn&#39;t, I don&#39;t know.<br><br>In summation: 3.5 stars, rounded up for ordering drinks via tablet for no particular reason. Totally overpriced, but the food is good, service is good, and the derrières around you may or may not be especially refreshed. This glorified sports bar is a welcome alternative to the standard pre-/post-Air Canada Centre fare if you have money to blow and can&#39;t stomach Jack Astor&#39;s...and you want a really good $21 crab cake.",
