"rating":"3.5",
"reviewcomment":"In Toronto with my family and had a really nice experience at Bar Italia.  Not much a Little Italy in Toronto, but that doesn&#39;t take away from this place.  We got a table right on the street.  Great for kids since they can make most pastas and sauces for the little ones. Mine had the Rigatoni Vodka, of course I sampled it, excellent.  My wife and I split a crostini with arugula and ricotta with fresh figs for an appetizer.  She had the fettuccini bolognese and I had spaghetti with their homemade spicy sausage.... All well prepared, full of flavor.  Combined with a nice red wine we ordered, it was a really fulfilling meal!<br><br>The service was attentive, friendly, and helpful as well!<br><br>Dessert.... The lemon tart was refreshing and tasty.  Their gelato was not good...seemed to be in the freezer too long.  The only glitch to an otherwise nice meal!",
