"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/UEgSdwfaC1ZrBLcz-Yat4Q/l.jpg",
"rating":"3.5",
"reviewcomment":"This place was completely off my radar. I never knew it existed even though its probably a century year old. It&#39;s mixed in with a dozen of mom and pop restaurants, in which the types of cuisine are dizzying and difficult to keep up with. It&#39;s also off a side street, on the second floor of a building, sealed by thick giant doors. Nevertheless, I&#39;m glad I know about it now and I&#39;m glad I ordered the chili chicken.<br><br>Picture a clean, spacious and slightly modern. Chinese restaurant, with a combination of booth and table seating. Hard isn&#39;t it? To my surprise, I sat there, patiently, looking across such a place, as I described above, while reading a traditional Chinese menu. It was a great feeling. I hear its packed at lunch, which I can and can&#39;t believe. Can because the food is both delicious and fair priced, can&#39;t because the space is large and seating is ample. <br><br>The thing to get is chili chicken on sizzling plate and make it dry so its crispy instead of the wet version which is saucier and less crispy. Order a bowl of plain white rice to tone down the spiciness and to also mute some of that robust flavour it packs. The combo will make you the happiest camper on the block. Not a fan of any sort of heat (I&#39;d rate this a 6 out of 10 for heat)? maybe stick with any of the classics like the Cantonese chow mein. I had that too, noodles were crispy as they should be and topping was normal too. Nothing to write home about though, keep that pen in your pocket. But chili chicken and I bet, other items on the special menu are definite winners.<br><br>After 12 bucks you go home super full and satisfied.<br>Overall, its a clean, spacious restaurant with good prices and decent service.<br><br>I am craving chili chicken right now. Rumours have it, Carlos Delgado (baseball all-star) used to come here and order three plates of chili chicken all to himself. I can understand why, but I hope he had rice too. Its a bit salty otherwise.",
