"reviewcomment":"After heading through the pedestrian entrance, I peered to my left and came face-to-storefront with Brick Street. I can rarely resist a bakery and this one was in the Distillery District -- making it even harder!<br><br>Upon walking in, I was greeted with the most wonderful smell of sugar mixed with happiness wafting through the air. Then I looked over and saw the macarons in all their glory begging me to buy and eat them.<br><br>Buy and eat them I so did. Two each: orange blossom, strawberry, vanilla.<br><br>These macarons were beautiful little specimens. I want more. I want more right now.<br><br>But do you know how far Toronto is from me right now?? An hour and 25 minute flight. A seven hour and 57 minute drive. 767 kilometers.<br><br>It&#39;s far. It&#39;s too far. These macarons are too far from me. I disapprove of this wholeheartedly.<br><br>...I also had a blueberry cream cheese triangle. That was good too.",
