"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/W5481d2yZDgpuniUyqeO8Q/l.jpg",
"rating":"3.5",
"reviewcomment":"Inside the historical Consumers Gas Building, this building has an interesting older spirit and detailing. A bit of a clashing interior style, however truly great service and quite a few worthwhile dishes.<br><br>read about our full experience on my blog:<br><a href='/redir?url=http%3A%2F%2Filianaspalette.blogspot.ca%2F2014%2F02%2Frosewater.html&amp;s=8584ac6025f03111987f99d78f716ec8bb87170bbf4e27ec2b947f77e1cea4e2' target='_blank' rel='nofollow'>ilianaspalette.blogspot.…</a><br><br>&#34;The presentation was impeccable for our Tuna Tartare!  It came on rectangular plate arranged with squiggles of hot sauce and a side of root crisps. <br>The Tuna Tartare had caramelized dried shallot chunks, avocado and a spicy soy dressing. The thin crisp roots were a great way to eat this paste-like tartar avocado salad. As for the raw tuna - tender, fresh and definitely of high quality. While the crispy white Grigio was an equal, close match for the tuna, the ravioli was definitely well enjoyed with the more full bodied, opinionated Valpolicella.&#34;",
