"rating":"4.0",
"reviewcomment":"A bit of a trek getting there and finding parking but it&#39;s well worth the travel. <br><br>I had the mix ceviche (fish &amp; shrimp) which was served with a very buttery avocado and fresh plantain chips. I&#39;ve been on a search for really good ceviche after having it almost everyday at Four Seasons Resort Costa Rica and I must day that this comes pretty close! The main dish I had was the Carne Asana which included tender strips of beef, rice and beans (which was to die for), coleslaw and fried sweet plantain. Everything on the plate just complimented eachother. The portions were also generous so I&#39;d say I got my money&#39;s worth. Also tried a bit of the fried red snapper which was very flavorful. Like the ceviche, it was pretty comparable to the red snapper I had at Four Seasons Resort Punta Mita.  <br><br>I highly recommend this place to anyone looking to try something new.",
