"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/UTo67tu1dc6-Q86_Z8MWrw/l.jpg",
"rating":"3.5",
"reviewcomment":"2 stars because the pizza came on time.<br><br>I called in, the girl on the phone was friendly. She put through our order and voila! Pizza is on time! <br><br>As I opened the pizza box, I was excited to see what yelp was yelping about. ?<br><br>Perhaps the pizza tastes better only when you&#39;re dining in? I&#39;m not sure. All I know is my delivery arrived within the hour as promised and my pizza was BARELY LUKE WARM. I called back to let them know; my pizza is cold. <br><br>The girl on the phone said &#34;I don&#39;t understand, I saw the pizza when he left. He left right away. Why is it cold?&#34; ....<br><br>Me:<br>&#34;We&#39;ll... I don&#39;t know? How am I supposed to understand?? I got a cold pizza lol what am I supposed to say?? &#34;<br><br>She responded : &#34;well I don&#39;t know he left on time so it shouldn&#39;t be cold. I saw the pizza when he left. &#34;<br><br>Me: <br>&#34;Ok.  at least my drinks were cold too... &#34;<br><br>she &#34;saw&#34; my pizza so it must have been warm right? LOL ! I basically called in just to let them know because maybe their oven wasn&#39;t working properly but apparently her eyes know all and my actual eating it knows nothing . <br><br>*** this review is for delivery only.",
