"rating":"3.0",
"reviewcomment":"I went to Sushi D for my birthday this past weekend and noticed they cleaned the light switch that I mentioned in my previous review so the operators of Sushi D must be keeping an eye out on the reviews on Yelp. Table was also cleaner (no more bad smell) but still a little grimy. Sishi D tip: use a little bit of white vinegar and water at the end of the day to clean your tables. It will cut the grime and grease off the table and neutralize odours. The vinegar smell will be gone by morning.<br><br>Anyways, service was better than usual. Waitress was a little more attentive but still not that great in terms of service. The man who brought out some of our orders and cleared some dishes was a little more talkative and polite. An improvement... but still needs some work. <br><br>Food quality was still consistently good and tasty. Portions were generous for things like the rock shrimp and orders came out fast. Well done.<br><br>Sushi D has improved a bit since my last review. I hope they continue improving their service and maintain their food quality.",
