"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/F-uZjg--MGABtvHrtNSgRQ/l.jpg",
"rating":"3.5",
"reviewcomment":"First time sitting inside which was quite loud, you&#39;re much better off sitting in their gorgeous patio. It&#39;s like being in someone&#39;s beautiful backyard for a bbq with way better food than your friends could ever cook.<br><br>We always get the same thing at Bairrada - start with the flaming sausage and some shrimps in that amazing garlic butter sauce. You&#39;re missing out if you don&#39;t sop up the garlic butter and some of those chorizo juices with the bread. <br><br>Main course is always a big garden salad (so simple yet so perfect, onion cucumber peppers iceberg and tomato in a house vinegarette) and the BBQ chicken with rice and potatoes. What on earth do they do to those potatoes to make them so delicious. They&#39;re perfectly cooked and that oil on them is delicious. Chicken is always nicely prepared with crispy skin and juicy meat. <br><br>To top everything off, and I mean I put it on everything, their peri peri sauce is not too spicy but certainly not mild. It&#39;s what sets them apart for sure.<br><br>Summer is coming, next time I&#39;ll be outside!",
