"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/6qnYT3GylxhKfqC5hfp_JQ/l.jpg",
"rating":"4.0",
"reviewcomment":"It&#39;s not ice cream.  <br>It&#39;s not gelato.  <br>It&#39;s not fro-yo.<br>It&#39;s freaking awesome frozen custard!<br>...Fro-cu....?  Maybe not. Anyways.<br><br>I ordered a scoop of vanilla frozen custard.<br>My custard barista winked at me and told me I wouldn&#39;t be disappointed.<br>He&#39;s was right.<br><br>Cold, creamy, light, and not too sweet. It&#39;s one simple but perfect dessert.<br>I&#39;m an addict.<br>I want more.<br>Now.<br>Right now.<br><br>I hear the affogato is pretty spectacular, so I&#39;ll be back maybe earlier in the day so I&#39;m not wired on espresso all night.<br><br>I&#39;m totally going here tomorrow. <br>And I&#39;m getting two scoops!",
