"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/mRikochyq5MfHtp5lhOpfA/l.jpg",
"rating":"3.5",
"reviewcomment":"When you&#39;re at Yonge and Eglinton there&#39;s a lot of food options in the area.  Places that are new or have been a neighborhood gem, The Duke of Kent (DOK) is a local landmark...or think of it as that show called CHEERS...but in uptown T.O. <br>First off this place is jammed packed, my broski and I were lucky enough to find a booth on the 2nd floor  of this pub. Though it was crowded the DOK is a warm, cozy, socially loud place where everyone comes to drink....eat...socialize...and play. But keep in mind after 6:30-7 seat availability may vary.<br><br>Our server was politely efficient. ..and chilled out...and knew his drinks, and food which is IMPORTANT in my books.  He was able to provide us recommendations, what types of foods we liked, how hungry we were?, chicken, beef? etc. etc.<br>after it was all said and done we made a decision.<br><br>The food....we both couldn&#39;t help not noticing their Caesar Steak n Fries.....lol $16.99...not bad at all...only drawback..my steak was medium rather than medium rare...oh well.  PORTION was satisfying. ..drinks complimented the meal....over ambiance is chill....and peeps are friendly....my Yonge n Eg joint aside from Spacco lol<br><br>Solid 4!!!",
