"reviewcomment":"Great breakfast! <br><br>Okay, the service was a little slow, but you just gotta settle in, read the newspaper, relax and enjoy yourself. There&#39;s nary a brunch line-up at this joint, but don&#39;t let that fool you. The quality is surprisingly good for an ol&#39; timey diner. Now, I don&#39;t eat meat, so maybe I&#39;m not the *best* person to review a steakhouse. But suffice it to say, I&#39;m an expert on diners in Toronto and this one passed with flying colours:<br><br>Strong coffee (well, *diner* strong, that is)<br>Well-cooked eggs<br>Perfectly toasted toast (hey, that does NOT apply to all diners, amirite?!)<br>Great homefries<br>Romaine lettuce and high-quality feta in the greek salad<br>Oh! And the wife said the bacon was great (again, really not a guarantee at all diners)<br><br>Do it! Don&#39;t let silly things like decor fool ya :)",
