"rating":"3.5",
"reviewcomment":"I have been following the owner of this restaurant from his Fidel Gastro food truck days!! Food was never a disappointment then. So when I heard he was opening up a restaurant on Queen West i was thrilled.<br><br>My boyfriend and I came here for the first time about 6 months ago and instantly fell in love with the decor and sort of communal seating. The manager greeted us right away and was so friendly, we told him all about ourselves and he recommended some drinks and food items. <br><br>Their menu is always changing but a classic and must have at Lisa Marie is the PAD THAI fries. So delicious and like nothing you&#39;ve ever tasted before. We&#39;ve tried about 3 different menus and most of the things on there. I trust his food decisions, so I try as much as I can. My favourite so far, beef cheek ravioli... mmmm and for dessert, the decadent Elvis in a jar. <br><br>This place is not where you go on a diet!! So much fun on the weekends, good food, great drinks and after 10:30, they have a live dj so amazing atmosphere!",
