"reviewcomment":"I would say that I&#39;d give this place 3.5, but I&#39;m rounding it up to four, cause the last couple of times I came, it was really very good. I have only ever been here for the All You Can Eat.<br><br>+Decent prices, even for dinner it&#39;s not unreasonable<br>+ Fairly large selection<br>+The last two times I went it was VERY fresh (the time before that was over a year ago, so I am giving them the benefit of the doubt)<br>+ Good service<br>+ Delicious, DELICIOUS tempura<br>~I didn&#39;t order a lot of sushi, my friend and I love the teriyaki dishes and tempura and edamame, etc, so I can&#39;t fully review the sushi, but what we had was good<br>+I really liked the salmon sashimi<br>-Didn&#39;t like the red bean ice cream<br>-Like I said, one time, a year ago, it didn&#39;t taste that fresh, but the past two times have been good<br><br>Overall a good experience- I will go back. Also- lots of seating! Yay.",
