"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/1g2XA_HrmMNsY823ATGHGg/l.jpg",
"rating":"3.5",
"reviewcomment":"Came here on Sunday for lunch. They don&#39;t open until 12 pm so we were waiting briefly outside until they opened. We were the first I the restaurant and sat in the dark for a few minutes as they were getting things set up. <br><br>Ordered rare beef pho and shrimp/pork spring roll. Pho was great, broth was rich in flavour, noodles were al dente and there were fresh red onions, green onions and cilantro as garnish.<br><br>Spring roll had fresh ingredients, quite enjoyed the freshness.<br><br>My husband got the vermicelli with grilled pork sausage. Sausage was tasty, the rest were pretty standard.<br><br>Service wise it was a bit slow. There was one server and one chef for the restaurant. We got our entrees and finished it before we got our appetizer spring roll. <br><br>Aside from the service, the food was good, you get what you pay for in terms of quality (was a little on the expensive side compared to other pho places). I&#39;d come back though.",
