"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/qgN0_x88fB-d_ZE_8t8chg/l.jpg",
"rating":"4.5",
"reviewcomment":"My favorite Vietnamese restaurant in Toronto. The BBQ vermicelli (pork and beef is my favorite) is amazing and is constructed very simply, but is done so well. The pho is absolutely delicious with no MSG from what I can tell. It is aggressively seasoned with star anise, but I really enjoyed it. For me the strong star anise flavor is what made the pho very unique compared to most places. <br><br>In addition, the portion sizes are great considering the price and the place is relatively clean (except the washrooms - atypical of most Vietnamese restaurants). <br><br>Finally, what really stood out the most about this restaurant is the front is run by an extremely friendly father and son combo that provided great friendly service. <br><br>This is my goto Vietnamese restaurant and I refuse to go anywhere else! If only they delivered I would eat here every week.",
