"reviewcomment":"Ate here on a Friday night with a friend and it was a good time. We enjoyed the $26.99 all you can eat premium tasting menu. It was probably one of the best AYCE places I have ever been to. I started off with the mango salad and my friend had the hot and sour soup. Both were great. Our favorite starter was the triple cheese dumplings which was a flaky crab and cheese filled pastry.<br><br>I had the sashimi which was good although the pieces were cut too thick for my liking. The presentation for each dish was always beautiful.<br><br>I really like the size of the main courses which were just enough so that you could try various things. I had the lamb chop. We finished things off with green tea  and coconut ice cream.<br><br>Oh and we also had wine. A bottle of 2013 sauvignon blanc cost us $25, which was reasonable. <br><br>Overall I would say it was a really enjoyable night with lots of great food in a nice atmosphere for the price paid. Definitely going to go back!!",
