"rating":"3.0",
"reviewcomment":"I&#39;ve been coming to Toby&#39;s for years and yeah the establishment isn&#39;t the nicest, especially the back area but I still love it.  The wings are in my top 5 of Toronto and an added bonus is that they come with fries.  People rant and rave about Duff&#39;s, St Louis but the wings at Toby&#39;s are better in my opinion.  They&#39;re a good size (not super steriod looking) and they&#39;re nice and saucy.  The servers are nice and they can take a joke.  <br>On cheap pitcher night there is nothing to complain about except for the occasional loud and obnoxious group which happens in most bars/restaurants.  <br>The other food on the menu is pretty average.  I&#39;ve had the nachos and a burger but the jewel of this place is the cheap wings and cheap booze.  If you&#39;re looking for a low key fun night then I&#39;d highly recommend Toby&#39;s.",
