"rating":"3.5",
"reviewcomment":"Wonderful dinner at Pangaea during winterlicious.<br><br>Mushroom Soup w/Truffle Foam. 3/5. Like some of the other reviewers, I think it needed a bit of seasoning.<br>Fois Gras Torchon. 5/5. A highlight. Silky smooth, rich, and beautifully paired with grape confit. <br>Scallops w/Pearl Barley Risotto. 4/5. Melt in your mouth scallops, good risotto, but the overall dish could have used a bit more &#39;oomph&#39; to make it a 5/5.<br>Bison. 5/5 A knockout dish that I could have gone back for seconds.<br>Chocolate Cake. 4/5. Great icing, but didn&#39;t jump off our plate.<br>Cheese Plate. 5/5. Beautiful cheeses, and great accompaniments. <br><br>Small portion sizes aside, a great dinner; and I&#39;d happily come back on a non-Winterlicious night.",
