"reviewcomment":"My girlfriends and I came here on a Sunday night and surprisingly it was decently busy. The restaurant don&#39;t take reservations for parties under 6 so we were lucky to get a table since the place isn&#39;t too big. <br>I have been to the Danforth location and the menu items looked the same. We decided to order 2 apps and an entree for each of us. The items we ordered:<br><br>Spicy grilled shrimp with this avocado salsa<br>Gorgonzola, strawberry and walnut spinach salad<br>Veal meatballs with a side of linguine <br>Orechiette pasta<br>Linguine with a rich tomato sauce and rapini<br><br>All the dishes were delicious and satisfying. The portions are actually really good for sharing. The flavours of each dish were well thought out and super tasty. I would say its Italian comfort food if there are such terms :)<br><br>The service was awesome and the servers are very attentive and knowledgeable. It was a really enjoyable evening with great food and atmosphere! <br><br>I definitely recommend this Italian restaurant and will be back again in the near future.",
