"reviewcomment":"We had a good dinner experience here.  The place was very crowded on a Saturday night but they were able to get us seated shortly after our reservation time.  No big deal.<br><br>The food was very good and interesting.  Complaints about serving sizes are justified, however.  The prices are not cheap and the serving sizes are relatively small.  I would definitely be concerned about coming here if I was starving.  This is more appropriate if you want a small amount of nice food.  There&#39;s nothing wrong with that, but if you come expecting something else you&#39;ll be disappointed.<br><br>Would also like to see a stronger beer list.  But this is nit picking, they have nice wines and that&#39;s their thing so again, it&#39;s not really fair to complain that the wine bar doesn&#39;t have good enough beer.<br><br>So - to enjoy, be prepared to spend, be prepared for &#34;elegantly&#34; sized portions, be prepared to have wine not beer.",
