"categorystrlist":"Seafood",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/0hyjsOXJ6xVHWfzT0-7ldw/l.jpg",
"rating":"3.5",
"reviewcomment":"I&#39;ve been here twice, with the same group.  Such an ideal spot for pre-Ossington theatre dinner.  The first time, we loved the food, the wine list, the service, etc....but we were in a bit of a rush.  We knew we were on to something, so we re-booked for an evening where we didn&#39;t have to rush.  <br>The wine menu is good, well-priced and lots of selection (or maybe its just stocked with my favourites).  We ordered a bottle and settled in to look at the menu.  So many choices!  We tried to have items that we didn&#39;t have the first time - we loved every item from the first time, but wanted to explore beyond.  Our server, Monica, was such fun and made great recommendations for us.  However, I really feel that you couldn&#39;t go wrong with much on the menu.  There were a few stand out items for us - gnocchi, seaweed salad, oysters, tartar, arugula salad.   I&#39;ll definitely be back - would also love to bring the hubby and kids.",
