"rating":"2.5",
"reviewcomment":"This Fran&#39;s is located on Front Street east of Yonge on the North side of the street. I&#39;ve been to both the College location and the Massey Hall location of Frans and both were quite good, with the Massey Hall location being my favourite. I expected more of the same from this location when I brought my boyfriend here before a game at the ACC.<br><br>The menu at every Frans is the same but the execution definitely is not. I ordered the grilled cheese and I recall on other menus it was a triple decker grilled cheese and was always nice and crispy, cheesy and came with shoestring fries. They&#39;ve changed up the fries at this location, not the best. It was an okay dinner but it really didn&#39;t live up to the Frans I&#39;m used to. Service was fast enough but we were sat at a table DIRECTLY beside the kitchen, which is a horrible location to sit. <br><br>If I had my choice, I&#39;d go back to the Frans at College or the one across from Massey Hall. Better food, better service and better experience. In a pinch, this one will do.",
