"categorystrlist":"Sandwiches",
"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/2_k-SzuMKUBPv3BykL9Szw/l.jpg",
"rating":"4.5",
"reviewcomment":"My boyfriend took me to the Fuzz Box after what he described to me as no less than a revolutionary taste experience. <br>I&#39;m not a big donair fanatic to begin with, and with a name like the &#34;Fuzz Box&#34;, which always makes me giggle, I had my doubts. I ordered a small donair to be polite. Since that first bite, I have dragged myself across town on several occasions to pay pilgrimage to this delicious treat. <br>The soft, thick, perfectly toasted pita is the best I&#39;ve eaten just about anywhere. The sweet aioli sauce mixes tantalisingly well with the savoury melt-in-your-mouth meat. There&#39;s a bit of fresh salad in the mix to relieve some of your guilt over this decadent dish. The quality is consistant.<br>By now, your mouth should be watering, and I hope for your sake that it isn&#39;t Sunday (they&#39;re closed).",
