"rating":"4.0",
"reviewcomment":"Great place for korean food in Scarborough. Service is a little slow but very cute, quaint place and servers are quite personable. I love how they set the korean appetizers in a stylish way on the table. <br>Been here twice, first time waited about 15 minutes, boyfriend got gamjatang (pork bone soup) and also kalbi beef (grilled marinated beef). Very good he said. Kalbi beef portion a lil on the smaller side but enough to satisfy a hungry stomach.<br>I got the beef rib soup, it was ok, it&#39;s not very flavourful which I had envisioned. Oops.<br>Second round was a few weeks later with the fam. This time I got pork cutlet. Great size and huge helping of korean salad, almost coleslaw-like. Delicious. Prices are between $7 -$35, expensive ones are things like dinner for two combo. My sister&#39;s korean ribs were $20. <br>Overall, clean decor, decent service, good food, nice location to satisfy scarborough korean cravings. Woo!",
