"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/2C6QA7HSvgN2UFR0G6Pk8Q/l.jpg",
"rating":"3.0",
"reviewcomment":"On a recent family trip to Toronto, I visited Smoke&#39;s Poutinerie on the recommendation from a friend who has family in Toronto. While out with 11 of my other cousins (and no, that wasn&#39;t all the cousins in my family!!), we stopped in. Just as most things I&#39;ve noticed in Toronto, it&#39;s a small place, with less than 15 chairs. Needless to say we took up all the space! With having that many people, one advantage is that we all ordered different things so that we could all taste as many dishes as we wanted :) For those who aren&#39;t familiar with poutine, it&#39;s a typical comfort food in Canada.....fresh cut fries, cheese curds, and beef gravy. We had a few varieties:<br><br>Traditional: just as the typical poutine, it has Smoke&#39;s signature gravy and Quebec cheese curds. I&#39;m not a huge gravy fan, so I was more appreciative of the varieties that Smoke&#39;s had to offer. With that being said, the gravy was pretty light and very flavorful! When I think of gravy, I think of thick Thanksgiving gravy that you pour over turkey. This one was more of a lighter sauce that was over all the fries. My only gripe is that the cheese that was used didn&#39;t melt quite as much as I would have liked. I&#39;m not sure if it&#39;s typical of Quebec style cheese-curds, but I didn&#39;t get the stringy consistency I like with cheese curds found in the midwest :) <br><br>Double Pork: Now although still with the traditional gravy and cheese curds, this was more my style with the addition of chipotle pulled pork and double smoked bacon. The bacon wasn&#39;t crispy like I&#39;m used to, so the texture of the entire meal was generally soft.  The flavor, however was awesome! The flavors of the pulled pork and the bacon were easily identified, but together made a great meal!<br><br>Chef Special - BBQ Pulled Pork Mac and Cheese: Now we&#39;re getting to some interesting combinations! This looked like it was specific to the Queen location. They took the chipotle pulled pork, added a mac and cheese that was more like a Hamburger-Helper type mac and cheese than your typical cheesy mac and cheese, but non-the-less it was delish! The addition of the pasta didn&#39;t do much other than add extra texture, which is sometimes needed with a generally soft dish. Overall flavor though was just as good as the previous!<br><br>Butter Chicken -  Being this was my first time here, I&#39;m not positive, but I believe this is a special this month at all the Smoke&#39;s Poutineries. If you&#39;re an indian food lover, than this is the poutine for you :) Butter chicken is (apparently!) a typical Indian dish. I tend to stay with my curries, so I&#39;m not super versed in the variety of indian cuisine :) I don&#39;t believe this one had gravy, but the butter chicken sauce. It definitely had an indian flavor, but it was not spicy. It had a strong &#34;spice&#34; taste, which was great, but it was not hot-spicy. My only complaint is that I couldn&#39;t tell the difference between the cheese curds and the chicken, so I couldn&#39;t even tell you if there was chicken in it! However, the flavor again was fantastic :)<br><br>Overall, some great local comfort food!",
"reviewcount":"41",
"pricelevel":"$",
