"reviewcomment":"I went to the Chase Fish &amp; Oyster (downstairs) in May 2014 for dinner and had an absolutely fabulous time! The two of us split the Bay Platter, fried chicken, ribeye steak, and shoestring fries. <br><br>THE BAY PLATTER WAS HANDS DOWN THE BEST SEAFOOD FEAST I HAVE EVER HAD. It came with a giant king crab leg, a whole lobster, a platter full of clams and oysters, scallop ceviche, giant cocktail shrimp, and tuna sashimi. It was a meal in and of itself - we clearly did not need to have two entrees in addition to the platter. I was impressed by the freshness of the seafood and dipping sauces provided - absolutely delicious. The fried chicken was also fantastic! The only criticism I had was the steak, which was okay but I would not order it again (perhaps my fault for ordering steak at a seafood restaurant). <br><br>The service was excellent as well. Can&#39;t wait to go back!",
