"rating":"3.5",
"reviewcomment":"One of my go to Italian restaurants in the city. Food is always really nice, and the deserts are especially good. Some nights i wish i could skip appetizers and mains just to get them instead! My personal favourite is the carpaccio. It&#39;s super simple, full of flavour, and like everything else, reasonably priced.<br><br>Service is usually good, but depending on who you get. The last time i came, our server seemed like he was just going through the motions. I mean sure he did everything he was supposed to, but it was nothing special. Other nights however, the servers have been terrific. On that night with the so-so server, i actually remember spotting the waitress who served me the first time i came and thinking &#34;i really wish i had her instead right now!&#34; Another complaint i have is that while minor, the hosts seem especially rude. Not a good first impression. <br><br>My only concern is that it seems a bit rushed. Don&#39;t get me wrong, the vibe and atmosphere are nothing to complain about. Always lots of families and large parties talking and having a good time. The problem is that the place is always so busy, i feel as if they try to get you in and out as quickly as possible. <br><br>Overall, it&#39;s a nice place to go to. Good food, pretty good service, and a good choice to go out with family.",
