"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/m_-xZJiIKfpcLPmLLVBi6w/l.jpg",
"rating":"3.5",
"reviewcomment":"I love this place! I used to go to the original Markham location to have their buldak (blazing spicy chicken?) and yang nyum chicken (sweet and spicy chicken?). It&#39;s an old favourite and whenever I crave some good old Korean chicken, I go there. I&#39;ve only had buldak at the Bloor location and it&#39;s still pretty good, although I find it little less spicy.<br><br>At 710 Yonge St, my favourite is the fried chicken. The salt/pepper that comes with the wings is like crack! I sometimes just taste the s+p alone... it&#39;s that good. I&#39;ve also had the lunch menu: the tofu soup, pork bone soup, and the rest are pretty tasty and very affordable for downtown.<br><br>The decor is not that fancy, but it&#39;s very typical in Korean restaurants (let&#39;s be honest, we go for the reasonably priced, delicious Korean food). The service is pretty good too: it doesn&#39;t get too busy during lunch hour and is only serviced by one waiter usually. Anyway, I&#39;ll keep coming by!",
