"rating":"3.0",
"reviewcomment":"I walked in because I saw this on a Bay Street trip earlier in the week and I decided to try it since I will be in that neighbourhood once my company moves.<br><br>I got sat down it wasn`t too busy and immediately I get a plate of basic chips, a salsa dip, and some guacamole. <br><br>The salsa wasn`t bad I`m not a huge spicy person but the guac seemed like baby food and I`m not of the latin descent but most guacamole I`ve seen is like a paste where as this was runny. The taste was ok nothing too extravagant.<br><br>I ordered the tacos they come in 4 ($15) and they had 3 flavors of meat; Pork, Beef, and Chicken. The beef was chunky much like the kind you find in a stroganof same with the chicken and the pork was shredded. The tacos came with the meats below, some fried pepper, onions, a separate dish with the cheese/tomato/chives a pasty guac all wrapped in a soft taco shell and served with a small side of a bean dip in a corn chip bowl.<br><br>The taste was ok nothing to rave about.<br><br>It seems like a place you could bring your date to if they were in the mood for some Mexican food.",
