"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/zx6uIc4_QP3xGNC3-GV-KA/l.jpg",
"rating":"3.5",
"reviewcomment":"There is just something so fresh about this place. As an employee in the Liberty Village area, this has become my goto Japanese spot for lunch. There are some other options in the area such as Kotta at King and Dufferin or a few on Atlantic Avenue but the quality of the ingredients here are far and away the best.<br><br>I tend to get the Sashimi &#39;Raaw Plate&#39; and you will not be disappointed by the freshness. The Salmon is non fatty, the tuna is similar, and just a delightful meal for the quality of product.<br><br>Even with the Maki there is a noticeable taste difference when they include the sesame seeds, the rice is cooked to perfection (no hard bits, etc). Gyoza&#39;s are not undercooked or over oily.<br><br>Best Miso soup for aftertaste I&#39;ve ever had and even the ginger is great (with no pink dye)!<br><br>Pros: Freshest Japanese food you will find in the area. Tastiest Japanese in the area.<br><br>Cons: Can be pricier, but really you get what you pay for. Not exactly the best ambiance for a dinner date with the warehouse feel.",
