"rating":"3.0",
"reviewcomment":"This place deserves four stars in my books, but I&#39;m going to qualify this: TDB really isn&#39;t a good place if you&#39;re looking for something that is trendy, or completely dive-y or pub-y. This place just sort of is what it is, which is a bland almost-sports-pub, but they don&#39;t apologize for their lack of identity. They just own it, and they reward their patrons handsomely. <br><br>How do they reward their patrons? With cheap stuff! Plentiful, cheap stuff! $10 pitchers of Canadian and a snack platter for under $30 that could feed a small island nation. I shared it with two friends 14 hours ago and I&#39;m still full, and we didn&#39;t even finish it. The platter consists of: wings, chicken fingers, potato skins, onion rings, french fries, calamari and garlic bread. There might have been more, but since I was hardly chewing and kind of drunk it&#39;s all really blurred together.",
