"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/JX61JCQ417ShrvBb9X3tlw/l.jpg",
"rating":"4.0",
"reviewcomment":"I love food and I enjoy dining in the many restaurants Toronto has to offer. However, I never bother to write restaurant reviews. That is because I&#39;m a very easy to please diner. If the food is good, the dining area is clean and the service is there... I&#39;m going to give it a 5/5. So I&#39;ll leave the restaurant critiquing to someone with a more discerning approach to it. But I would like to say a couple things about my recent experience at Nunu.<br><br>First off I should mention that I am familiar with Ethiopian food. I grew up in an Eritrean household eating many of the types of dishes on the menu at Nunu.  Eritrean food is nearly identical to Ethiopian food. My date and I ordered the Misto Misto and we found it fresh, delicious and very well presented. I particularly liked the way the different foods (meats and veggies) were equally spread out on the dish (Ethiopian and Eritrean meals are eaten with the hands - right hand only - from a communal plate).  There was no need to awkwardly reach across the plate to sample the different foods.<br><br>The atmosphere is trendy, fun and very much in line with the neighbourhood bars and restaurants.  The dining space was clean and open with an airy and welcoming feel.  This is not typical of the Ethiopian/Eritrean restaurants I&#39;ve been to in the city.  Most have good food and relatively attentive service but the dining rooms almost always leave a lot to be desired.  We arrived around 8pm on a Saturday without reservations. The place was packed! The only waitress, who is also the owner, was a little overwhelmed. She mentioned that she was desperately looking to hire more wait staff.  Nevertheless, we were seated quickly and our food came out surprising fast.<br><br>Overall, I&#39;m impressed with this place. I very much enjoyed my experience. And I highly recommend it to anyone interested in trying something a little different. Whether you&#39;re new to Ethiopian cuisine or you grew up on injera, I think you will leave Nunu with a unique experience.",
