"reviewcomment":"My best friend and I initially meant to visit the Keg mansion in the same area as o&#39;Grady&#39;s. Long story short we decided to try some other area to go to because the Keg was still closed. When we got there we saw the menu and thought it looked delicious and they even offered a brunch special. We decided to give it a shot. When we got there we were greeted fairly by the hostess who sat us down and gave us the menus. After ordering two brunch specials, we noticed how somewhat empty our plate kinda looked. We only got two pieces of bacon, one sausage and a decent amount of eggs. Usually grabbing brunch from other restaurants your plate is more full and feels like it&#39;s worth your money but here it didn&#39;t as much. Although the special was decently cheap I would have expected to get atleast a good amount of the food I&#39;ve ordered. The hostess was nice but I found that the people working there were barely even there, when we needed assistance. I believe they were all gathering for some type of meeting while customers were in the restaurant, when it would be more better to be doing that when customers aren&#39;t around. Other than that<br>It was an okay experience but I likely won&#39;t be coming back.",
