"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/DIVhrxT6YAzfJuT0B8p8WQ/l.jpg",
"rating":"4.0",
"reviewcomment":"Let&#39;s be honest, it&#39;s pretty easy and common for restaurants to f*ck up Winterlicious, but Byzantium nailed it for me. For a $25 dinner, we had lots of choices for each of the three courses.<br><br>I had the creamy mussels, supreme of capon (aka chicken) with apple bread stuffing, and chocolate cake. All DELICIOUS. This was my first time trying mussels after like a 10-year hiatus, and they were SO GOOD... The soupy marinade they came with was exquisite. The chicken was flavourful and moist, as was the chocolate cake.<br><br>My friend who is deathly allergic to nuts was also able to join us for dessert, which is rare... She was stoked. Service was lovely and attentive. The bartenders were friendly and hot (although, judging by the neighbourhood, they probably didn&#39;t even glance my way). The martinis were exciting.<br><br>Great experience... Thanks Byzantium :)",
