"rating":"3.5",
"reviewcomment":"Reviewed Dish: Halibut and Fries<br><br>It&#39;s really an unassuming hole in the wall kind of place.<br>It&#39;s more catered to take out crowds, it can probably sit 3 people inside. But there&#39;s a table outside the restaurant.<br>The halibut is so fresh that the meat is still flaky, the batter is so light light and crisp. The finished product is easily the size of 2 pieces of fish anywhere else!<br>Overall the portion size is more than any other Fish &amp; Chips place I went to, and it tastes incredible.<br>They even have a hand press to make the fries on the spot, so it&#39;s really fresh.<br><br>Reviewed during: Mon - Fri Lunch time<br>Service Speed: It&#39;s pretty much a take out place<br>Cooking speed: 4 / 5<br>Food Quality: 5 / 5<br>Food Quantity: 5 / 5<br>Price: 4.5 / 5 <br>Cleanness: 3 / 5 <br>Repeat: Yes",
