"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/x_6gRtCYRZu01th9K78Mmg/l.jpg",
"rating":"3.5",
"reviewcomment":"For those who never knew, Carmen is the same owner of Toritos tapas bar in Kensington, hence it is no surprise the quality of food plays a melody on your taste palate. A popular choice in the Trinity Bellwood area of TO, CARMEN serves out your traditional Spanish dishes ranging from various tapas to your choice of paellas! <br>First impression was the cute bar decor right by the entrance and its chic new age contemporary design from the portraits, boutique chandelier of bottles, to the huge mural on the wall. The service was excellent, and it was a nice surprise to see Carmen bringing the &#39;Paella de Carmen&#39; to our table.  :) lol<br><br>Paella de Carmen; mussels, clams, shrimps, scallops, chorizo, chicken and safron 5/5!!!!!!!!!!!! Segovia Restaurant, seems like you have competition in the city... this dish was a delight to my taste buds! Aromatic, robust and versatility of flavors left my foody partner and I speechless...lol. Plus to top it off the presentation was top notch!<br>In addition we both ordered the Primicia joven tempranillo to compliment the meal.<br><br>Dessert cookies with dulce de leche! Que rico! Wish they sold these babies in boxes to buy and take home :( 3bite cookies with Dulce de leche filling..pure bliss! Like I just died and went to IBIZA!!!!!!!!!!!!!!!!!!!!!! <br><br>I&#39;ll be back pronto",
