"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/l4If4OSFn-m9U-S6sJiI3Q/l.jpg",
"rating":"4.0",
"reviewcomment":"This place has solid good Indian food for a great price. Very authentic, unlike crappy Lahore Tikka House down the road. The ambience here is tacky and uncomfortable (it sucks quite honestly, but I gies that&#39;s why we&#39;re paying this price). Whenever we&#39;re craving good Indian food these days, we head here. I always get 1-2 dishes to go as well, since it&#39;s really good value for money. Making it at home will probably cost me around the same amount.<br><br>Meat samosas are good, butter chicken, kadhai chicken, chicken tikka masala, biryani... everything we&#39;ve ever tried really. Naan is good too. Head here for delicious reasonable food, but don&#39;t expect a fancy place. The guy who takes the order at the cash is a little confused always.<br><br>We actually ordered samosas and biryani for a pre-wedding family dinner from here, and people loved it. It was so reasonable and good. Highly recommend this place. I have a terrible dislike of Lahore Tikka House with its non-authentic, re-fried, over-priced crap. I&#39;d come here and deal with ambience issues any day for the delicious food.",
