"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/6Pg2l9CbuJ6dPNKEZdFtlg/l.jpg",
"rating":"3.5",
"reviewcomment":"We ordered 2 medium pizzas for delivery, one was custom toppings and the other one was a signature pizza - Cacciatora Pizza<br><br>The bill came to 47 dollars before tip, so it is a bit pricey compared to chain pizza places, but it was well worth it.<br><br>First of all, what Frank&#39;s calls a medium is actually a large, so keep that in mind.  Secondly, WOW!  The toppings and crust were completely perfect as was the service I received both from the delivery driver and the person answering the phone.<br><br>The toppings were extremely fresh and most of them seemed hand cut.  The crust was firm, yet was soft enough to eat.  The crust had some nice charring on some spots without burning the toppings.<br><br>I&#39;m glad we gave them a try, this will be our household&#39;s new go-to place for pizza in this area.  Overall, the food and service were both A+",
