"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/OQR4enRL-mlr2fZmn3jQNg/l.jpg",
"rating":"3.0",
"reviewcomment":"My boyfriend and I had our first date here--many years ago... We had nachos and told each other offensive jokes while everyone else in the pub watched the Leafs get their asses handed to them in the playoffs.  We&#39;ve been several times since, but had a really nice brunch this weekend.<br><br>No waits or lineups for the patio on a gorgeous day and we were thrilled to learn that they have $2.99 Caesars! They bring you the Caesar from the bar and you take your drink to the Caesar station and put any myriad of things in it that you want: olives, celery, cucumber, pickled olives, gherkins... Even pepperoni sticks!!<br><br>A basket of tiny muffins arrived at our table shortly after ordering. Two of them were sweet and two were not so sweet, but I was busy with my Caesar.<br><br>We both had eggs with Farmer&#39;s sausage, Cajun spiced home fries and marble rye toast. This breakfast was surprisingly good for chain pub food. Everything on the plate was carefully presented, properly cooked and the marble rye was great.<br><br>Service was wonderful. And I know from experience that Brunch shifts are almost like punishment. Our server was helpful and on time with everything.<br><br>This place does a solid brunch and with the addition if $2.99 Caesars?? You have to be loving  this place!",
