"rating":"3.5",
"reviewcomment":"I love this place! Perfect location (steps from the Panasonic Theatre on Yonge Street, near Yorkville, and surrounded by a great variety of shops), ambience is cozy and relaxing, and the service is welcoming and upbeat.  I discovered this the night I went to see Arrabal.  Hassle-free, fun, and most importantly, the food was delicious and ready promptly.  <br><br>I ordered Oja&#39;s Chicken Teriyaki Bento Box ($12 approx), which included shrimp &amp; yam tempura, steamed rice, glass noodles, California rolls, miso soup, salad - and a slew of Korean appetizers!  Radish, beans, kimchi.  The tempura especially was to die for. Melt in your mouth light, fluffy batter, bursts of fab flavour, generous size.  Such a varied and excellent quality meal.  <br><br>My friend and I sat by the window, watching life on Yonge Street float by in our happy bubble. I highly recommend popping into this pretty little place - wonderful experience. :)",
