"rating":"3.0",
"reviewcomment":"On this very cold night, we decided to use our voucher to dine at this mexican place. Its been here for 6 yrs, but I&#39;ve never once come across or noticed this place. Small place where seating capacity is no more than 50ppl. Not much of a Mexican feel though, no sombrero and Mexican heritage. Maybe they&#39;re fusion of some sort.<br><br>Started with some complimentary tortilla chips with salsa. Our voucher was the one app, two entree, one dessert for a set price.<br><br>App:<br>Shrimp Ceviche $12<br>Marinated shrimp in lime juice, dressed with avocados, tomatoes, cucumber<br>olives, cilantro &amp; onions.<br>- Didn&#39;t really need the olives. The plate was marinated with too much juices on the plate. The shrimp is alright. Good portion.<br><br>Main:<br>Fajitas $18<br>&amp; choice of chicken, beef, shrimps or veggies. Served<br>with rice, beans, tortillas &amp; topping.<br>- Got the shrimp fajitas. Good portion. Didn&#39;t touch the beans.<br><br>Lobster Tacos $18<br>3 Corn tortillas filled with Guajillo lobster,<br>bell peppers &amp; onions, served with beans &amp;<br>toppings.<br>- Good portion. Lobster meat were mainly claws. Kind of spicy dish. Didn&#39;t touch the beans.<br><br>Dessert:<br>Got the Fried Vanilla Ice Cream. Not bad.<br><br>This place I&#39;m not sure why its slow, but the food is alright. I&#39;d probably try elsewhere just to compare the differences as this place didn&#39;t stand out for me.",
