"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/BOZCkYXgj495ylhnUwlHBA/l.jpg",
"rating":"3.0",
"reviewcomment":"This place is gorgeous! The interior is very well-lit and showcases just how clean everything is. The mini chandeliers are cute, without being overly ostentatious. I think that the fact that it occupies a basement location in Chinatown makes its cleanliness and decor all the more impressive. There are also massive TV screens on either end of the restaurant, so you can comfortably watch whatever is happening without making your dining companion(s) feel too neglected.<br><br>Kachi prides itself in its pork bone soup, and rightly so. Is it the best pork bone soup I&#39;ve had? Possibly. Is it an excellent pork bone soup? Definitely. I have yet to find that curious layer of orange grease that is so often present on the top of PBS. I also liked the balance of ingredients (ie. pork bones, potato, bean sprouts, cabbage), though the ratios do vary. You may argue about the authenticity of the lime wedge, but I found it to be a nice addition, as it cuts back a bit on the richness of the pork bone. &#34;Authenticity&#34; is overrated anyways. <br><br>The tofu soup is chock-full of ingredients, and dumplings are tasty. I also LOVE that they serve genmaicha along with your meal. A very classy touch.",
