"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/FRDPxFfcbWhS0dt6UfV3QA/l.jpg",
"rating":"3.0",
"reviewcomment":"I am so glad we came here! My friend and I wanted some sushi (yes, while in Greek town... what can I say - the heart wants what the heart wants) before our concert at the Danforth Music Hall. This was close enough, and we were looking for something simple and reasonably cheap.<br><br>This place hit the nail on the head. The fish tasted fresh, delicious and not &#34;fishy&#34;. Our replacements in the sashimi/sushi combos were arranged easily. The service was excellent (the waiter brought 2 salads and edamame and miso soup when I ordered 2 teas and wine - he confirmed that we will be on a timeline to get to our show. Very nice!)<br><br>The meal we had was simple - sushi-sashmi meal, and half a litre of white (nice thing - 2 glasses of white cost as much as 1/2 a litre - so nice place for 2 girlfriends to catch up in!)<br><br>Are there fancier sushi places? Without a doubt. But if you want a cheap, clean, nice, easy sushi place with good solid basics this is as good as it gets!",
