"reviewcomment":"Hands down one of my favourite sushi places in Toronto.  I love the ambience, the service, the variety of food and the quality of food.  All around 5 stars.  You won&#39;t be limited to sushi here, there is a little bit of everything for everyone, done in a classy way.<br><br>BLACK COD - amazing, this is almost as good as the one at Guu (which is my have black cod dish!).  It&#39;s so buttery and delicious, the flavours really worked with the miso - very highly recommended.<br><br>PAN FRIED GYOZA - this was a pleasant surprise!  It felt home made, the flavours were rich and it was panfried - nothing was hidden by being deep fried!<br><br>DIM SUM HAR GOW - hmmm being in the mood for sushi, sure I could have gone for dim sum as well!  That&#39;s the beauty of this place, there is a little bit some something for everyone.  The Hargow wasn&#39;t anything special, but it was a good touch because it satisfied all my craving and senses.<br><br>THAI TOM YUM SOUP (SHRIMP) - this was delicious, very fresh and filled with hearty vegetables, it was very refreshing.<br><br>VOLCANO ROLL - it was crunchy deliciousness.  I love sushi that is fresh and also not filed with a thick layer of rice.  This roll was all ingredient and very little rice, it tasted fresh and the presentation was beautiful.<br><br>GREEN DRAGON - very well done, classic and traditional, but it was very fresh and very nice flavours, beautiful layered with Avocado.  <br><br>Overall, it was reasonable priced, the service was very attentive.  This is a good mixture between quality food of homemade mommy goodness and Yuzu classiness without the pricey-arm-and leg experience.  A must go, everyone that walked by stopped immediately to look at the menu, this place will do very well.",
