"rating":"3.5",
"reviewcomment":"Mmm, just thinking about this burger place makes me hungry!  Their burgers are nice, thick and juicy and their gravy is so beefy and good.  It&#39;s one of those places where I surprise myself and end up eating way more than I probably ought to.  <br><br>The best thing about this place is the superb customer service, which I have to admit is rare at a burger joint.  I went on a Sunday, ordered a burger and was hoping to pop by the fro-yo place across the street before coming back to pick-up the burger.  Turns out, the fro-yo place was closed and I came back and instead ordered the fries and a Jones cream soda in addition to my burger.  The guy was super nice and even told the cooks in the back to have my fries and burger come out at the same time.  Mmm, the fries were so good too, I will definitely have to try the poutine next time because although Smoke&#39;s Poutinery is just a few blocks down, these fries definitely were superior and tasted great alone too.",
