"rating":"3.5",
"reviewcomment":"Amazing. Quality<br><br>I had the pleasure of ordering the Beef ribs. Most restaurants interpret charring as burning the meat till it&#39;s crispy. The ribs I received were slightly charred and actually added a nice texture and flavour to the meat. The barbeque sauce was also equally as delectable as it wasn&#39;t overly sweet but just enough for taste.<br><br>My most pleasant surprise came in the form of the 2 sides I ordered, salad and steamed vegetables. I was happy to see actual fresh vegetables that were cut in house and not out of a frozen bag. Vegetables that come out of a bag are definitely one of my pet peeves and I believe they have no place in a restaurant. This small touch, is what cemented the quality of the restaurant to me. <br><br>On my way out I had to compliment the chefs because of the attention to detail that is sorely lacking amongst other restaurants. If you are in the area and want quality, this is the place to go.",
