"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/LtzrW38mpz5fLh28_JGUjA/l.jpg",
"rating":"4.0",
"reviewcomment":"Food Satan: So, you want to work downtown, eh? Well, since you work amongst those who make the most money in all the city, YOU WILL FOREVER PAY NO LESS THAN TEN DOLLARS PER LUNCH! Ha ha ha!<br><br>(The clouds open, and a beam penetrates the darkness)<br><br>Food Satan: WHAT&#39;S THIS!?<br><br>(More light pours through, and grains of rice as fast as bullets spill in, piercing Food Satan a thousand times)<br><br>Food Satan: NOOOOO!!!!!<br><br>(He dies)<br><br>The hell is this? A hearty, tasty meal at King and Spadina for about $6? Sign me up. At least once a week. They have a veggie special Dal Sabzi, which is like a hot curry packed pretty decently with split peas, broccoli, carrots and peas, and with a side dish of some kind of magic tomato-salsa-type thing. By default, it&#39;s served with a naan bread (pretty good quality), and a salad. If you want it vegan, you&#39;re going to have to get it with no dressing. The default is a cream-style dressing, and their oil-and-vinegar alternative is pre-made with feta cheese bits in it. But whatever. I keep a bottle of salad dressing in my work fridge for this occasion.<br><br>This is really the cheapest tasty meal I&#39;ve found nearby that isn&#39;t a gross and greasy falafel sandwich.<br><br>Warning, hot is very hot. Even medium is sometimes very hot.",
