"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/GqJCXg3BDEbrPj6xrzqK3A/l.jpg",
"rating":"3.5",
"reviewcomment":"I absolutely adore Cheesewerks. In a nutshell, here are some of its highlights:<br><br>-Family owned and operated; the staff here are always happy, sweet, friendly, and accommodating<br>-Awesome trivia nights. Cool prizes (even for non-winners), a great mix of categories (from general random knowledge, to guessing that song/artist, to watching videos and frantically writing a million things down to spew back random facts, to cookie stacking!)<br>-Fondue Fridays. While they have yummy fondues most days, there are a wider variety available on Fridays (and comes with a nice spread of different goodies to dip into). <br>-Board games! Yep, they have a selection of board games you can break out while enjoying your cheesy treats<br>-The Mac and Cheese ROCKS. It is perfect comfort food (especially in the chilly winter). It is ooey gooey cheesy amazingness.<br>-Candy Bar Grilled Cheese. It may sound weird, but try it, you won&#39;t regret it. It&#39;s pretty much a candy bar of your choice (you get to pick from a giant jar), with some mascarpone, served with syrup and fruit. It. Rocks.<br>-They have lots of deals going on - follow them on twitter &amp; facebook to keep posted<br>-BRUNCH! They have an awesome brunch menu that is ever-changing<br>-Free parking! Something that is rare and awesome in this area <br><br>Check Cheesewerks out next time you&#39;re in the area. You won&#39;t regret it.",
