"rating":"4.5",
"reviewcomment":"Falasca is part of &#34;my 5 Stars&#34; because they do make a decent Roman Style pizza at a good price. Well, they actually make the two kinds of  pizzas I can find in Rome. &#34;Pizza al Taglio&#34;, the pizza usually sold in bakeries by the weight and is a typical street food,. With a pop makes a very good lunch. Then, The usual 12&#34; dinner pizza, the popular paper-thin crunchy Roman pizza with the topping reaching the edge. Wish they had a wood-burning oven.<br><br>I was used to go with my friend for pizza in Rome and having 2 or 3 of dinner pizzas just for myself. Light as a feather it would never fill up my stomach.<br><br>I miss my Dolce Vita, but life can be as sweet in TO as is in Italy... well...the weather needs a little help...",
