"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/zMGJntm318ApqNZkriW59A/l.jpg",
"rating":"4.0",
"reviewcomment":"Went here on a suggestion of a friend, and was SO happy I did!<br><br>The Grove was basically made for me. If I had to create my own restaurant, this would be it! It&#39;s all about the tasting menu! <br><br>The restaurant itself is well designed with lots of groups of tables and a long bar when you arrive. There is dim lighting and I honestly think this would be a perfect date spot, especially if you and your date were up for splitting each others food (more options!!).<br><br>They have a great cocktail list and a decent wine list, with a good variety coming by the glass. Cocktails are a little pricey, coming in around $14, but well worth it. I tried the &#34;Corpse Reviver&#34; and was quite happy with it, it had a serious kick. <br><br>The Tasting Menu is $45 for 5 choices, and is unbelievable. You select 4 savory choices and one dessert. <br><br>Each dish comes out beautifully plated, like a piece of art! Everything I tried was amazing, my favorite being the seared tuna with chicken skin chips and frozen guacamole (WHAT?!). <br><br>During the meal, they break up your courses with a few little bites which come on the house. For us, this including a tiny Parmesan puff, teeny personal baguettes, and a delicious mini dessert tart. <br><br>I LOVE that I was able to try so many little things, and still feel completely satisfied at the end of my meal. I can&#39;t wait to go back!",
