"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/4gDXuS41YPvjRe6MhFVnKA/l.jpg",
"rating":"2.5",
"reviewcomment":"Positives: More than decent food, huge HD tv in the middle of the bar great for viewing live events! Extremely attractive waitresses (up to the point of employment discrimination really lol), Mens toilet urinals overlook dundas square!<br><br>Negatives: extremely overpriced (as is expected from a sports bar downtown Toronto), bad and lethargic customer service; real life e.g. it takes nearly 30 minutes for a server to pass by and give us menus, another 25 minutes to get our drinks and then another 20 for the food (over an hour wait so far), when the industry standard is 12 mins! oh and ofcourse they messed up my order I specifically asked for NO BACON on my cheeseburger (but meh lower tip for the server). Also they overcharged us more than once on separate occasions! I didnt order three beers, I only ordered one thank you very much.. Oh lets not forget another 20 mins to get the bill!<br><br>Three star rating. Only go there for reliable big screen HD tv sporting events and some eye candy from the waitresses ;) as for Food? only If youre willing to wait and overpay!",
