"rating":"3.5",
"reviewcomment":"This place has the best Cantonese style Chinese food on the Spadina strip. Although Toronto prides itself on its diversity in ethnic food, most people know the good Chinese food is in Markham / Scarborough. And while that is true, New Sky will have you returning back. <br><br>Having been here by recommendation, I have since been a returning customer. It saves me a trip to the suburbs when I crave the food of my people.<br><br>Beware though, they have a secret (better) menu in Chinese that I&#39;m assuming would only be given to you if you appear to be Chinese. And although I am Cantonese, both times the Chinese menu was only offered to me once I&#39;ve asked. <br><br>Recommend dishes: Fried snow pea leaf, sizzling satay beef, fish and tofu clay pot, scallion and ginger stir fried lobster.<br><br>OH: also, BONUS! The servers here are very friendly. They all speak decent English and are relatively attentive.",
