"reviewcomment":"This is a more family-orientated sit down middle-eastern restaurant when compared to others in the area. It has been in the area for years and has won many awards for being the best Middle Eastern food in Toronto.<br><br>The menu has many different meat options (chicken, beef, lamb, etc.) and comes mainly as kabob&#39;s. All mains appear to come with rice and salad. There were three of us who dined this evening there. Two of us got chicken skewers. They were perfectly seasoned and the meat remained moist. The rice was very tasty as well and it was clear the salad was made with fresh vegetables. The third member of our party got beef skewers and from what I could tell that was juicy and moist as well.<br><br>The one downside was the coffee which was not enjoyed by our table and from what the others could remember, they&#39;ve had a similar experience with their coffee before. Dessert (vanilla and chocolate tartufo) was up to par with many other places that offer it.<br><br>All in all, atmosphere is warm and inviting. Servers are attentive and will remove the skewers from the table once is clear you are finished with them. Price point is great for the amount of food received and the quality of the food. This place is definitely worth a try as both a take out or a sit-down option.",
"reviewcount":"31",
