"rating":"4.0",
"reviewcomment":"Let me start by saying that I have stomach flu so I can&#39;t eat anything spicy or greasy. How I got it is another story.<br><br>Back to the review. So I was on the lookout for a non-spicy, non-greasy option in the PATH, and spotted the chicken noodle soup here. Initially I thought $9.05 (what the medium size cost with taxes) was pricey. Well I still think it&#39;s pricey, but it was very flavourful so I&#39;m willing to forget that for a few minutes. It was good hearty soup. But I didn&#39;t necessarily want the sides that come with it--I&#39;d rather pay a little less.<br><br>The line was long, but moved at a reasonable pace. Soup of the spicier options looked delicious, and I bet those are more worth the money than the chicken noodle. I&#39;ll be back to try those. <br><br>This should have been a 3.5 but I&#39;ll update soon.",
