"rating":"3.5",
"reviewcomment":"I&#39;M PRETTY PICKY when it comes to food, and in PARTICULAR sashimi - you can tell when its NOT fresh and I refuuuuuuse to pay for old fish -that is not any food should be served; if the sashimi is not good the second time around there is SLIVER of chance for me returning. <br><br>We entered here because AJI SAI was too far and I was starved which makes reasoning hard and grumpy- well I didn&#39;t stay that way long. <br><br>An incredibly funny thing: on the all you can eat menu under sashimi? - it says &#34;cocked egg&#34; lmao I peed myself laughing on that one.<br><br>I will say the one downside was that the staff didn&#39;t really speak English well and they weren&#39;t all that interactive but, they were super patient and tried to communicate. The service was very good. The food was very good - they even remembered that I don&#39;t like octopus and never included in future orders and the portion was just right for two people. Did I mention that the fish was very good? Well, it was, in case I forgot.<br><br>DOWNSIDE:<br>I REALLY WISH I HADN&#39;T STUFFED MY FACE AND LEFT SOME ROOM FOR DESSERT, and that I would learn one day to NOT go for all you can eat.",
