"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/Bch0llMZ61MRxyuUkTQ50g/l.jpg",
"rating":"3.5",
"reviewcomment":"I came to Universal Grill for brunch about a year back- it tasted great, was crowded and bustling, and we were in and out fairly quickly. An OK experience but nothing that made me want to crawl back for dinner. Too bad that I&#39;ve wasted so many months thinking about where to eat next when what I was really looking for...was staring me right in the face the whole time (sort of like Fox and Scully).<br><br>Came for a dinner in what I&#39;d describe as an &#34;upscale-diner&#34; environment. The menu had a comfort-food vibe, but designed by someone who&#39;s adept at preparing more classically higher-tier fare. Does that make sense? I hope so. <br><br>The ambience was great, the servers were kind and beautiful, and my main dish of cornmeal crusted cod was perfect. Very much in the face of my &#34;there&#39;s no good seafood in Toronto&#34; attitude. <br><br>I went with Evelyn W, so It was actually a 4-star experience...but I won&#39;t take that away from them. Great meal, great friends, see you tonight.",
