"rating":"3.5",
"reviewcomment":"This may be my new favorite AYCE sushi place and I don&#39;t even like AYCE that much.<br><br>The food is delicious and they offer an extensive menu. Tuna naruto is my favorite! Cucumber wrapped instead of rice. So good. The sashimi is served on a bed of ice so they don&#39;t get warm from sitting out. The sushi rolls were decently sized although a bit too much rice for my liking. <br><br>Grilled foods were flavourful however don&#39;t expect great cuts of meat for all you can eat. Beef was a bit chewy. What really blew me away was presentation of the foods. Each dish came out nicely presented. You can tell they put effort in it and it looks nice but we quickly ran out of room on our table because the plates were so big. <br><br>They serve black sesame ice cream which is a win in my books. Didn&#39;t bother to try the other stuff.<br><br>The washroom was also surprising as it&#39;s unisex so just be wary of that. Service was alright. They weren&#39;t that busy when I was there however and it still took a while for refills.<br><br>Overall, one of the better AYCE I&#39;ve been to. Definitely worth a visit.",
