"rating":"2.0",
"reviewcomment":"Went here recently on a trip to Toronto and had a pretty good experience. The service was excellent. The first morning we went, I ordered the Belgian Waffle with Apple and Vanilla Ice Cream and loved it. I didn&#39;t even need to put syrup on it, when I&#39;m usually one of those people who likes to drown their pancakes and waffles in syrup. The square coffee cups were neat.<br><br>The second morning I wasn&#39;t quite as impressed, I got the Swiss, Broccoli and Chicken omelette which didn&#39;t have nearly enough fillings. My fiancé ordered the western omelette but wanted cheese instead of the green peppers. They added green peppers anyway along with the cheese, but didn&#39;t charge for the cheese. <br><br>Overall, it was a decent breakfast and I&#39;d eat there again if I was in the area.",
